(1, 'hayes-power-electrics-82684', 'Hayes Power Electrics', '', 'We provide energy saving electrical solutions for domestic lighting installations and large scale commercial & industrial projects.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'hayespower@westnet.com.au', '1300772472', '', '', '', 0, 0, 0, 0, 'http://www.hayesenergysaver.com.au', 'WELCOME\n\nHayespower Electrics, located in Beaconsfield, 3807 has an experienced team of qualified electricians for all types of electrical work.\n\nABOUT US\n\nHayespower Electrics Pty Ltd is a privately owned electrical contractor company servicing Melbourne & outer suburbs in the Commercial, Industrial & Domestic markets that provide energy saving electrical solutions for domestic lighting installations and large scale commercial & industrial projects.\n\nAlso, we specialize in solar power systems and LED lighting retrofits, enabling existing lighting installations to be upgraded and deliver substantial cost savings and energy consumption reductions.\n\nHayespower Electrics values their clients & has established long term business relationships with excellent communications & service capabilities.\n\nThe Hayespower Electrics team is passionate about what they do and are fully committed to the highest professional standards of workmanship and service.\n\nUnder Paul Hayes leadership, Hayespower Electrics has grown to be a well recognised electrical contractor company with many established clients in the Commercial, Industrial & Domestic sectors and provides customised energy saving solutions for them.  \n\nHayespower Electrics Pty Ltd is a registered private company with Paul Hayes as the Managing Director and operates from Factory 4/ 86-92 Old Princes Highway, Beaconsfield, 3807.\n\nThe business commenced operations in 1993 with a vision & plan to provide the best electrical contracting service in the commercial, Industrial & domestic markets in Melbourne & outer suburbs.\n\nHayespower Electrics can provide the following electrical services: \n\n* All your electrical needs when refitting retail or business premises to change their current configuration.\n* Complete upgrade of switchboards and capacity.\n* Mains upgrades\n* LED lighting\n* Testing & Tagging\n* Building maintenance\n* Data cabling\n* Exit & Emergency lighting installation & Maintenance\n* Emergency breakdowns', 'A', '{"1":[[0.375,0.708333333]],"2":[[0.375,0.708333333]],"3":[[0.375,0.708333333]],"4":[[0.375,0.708333333]],"5":[[0.375,0.708333333]]}', '', '', '', '', '', '', ''),
(2, 'greenwood-electrical-group-pty-ltd-82677', 'Greenwood Electrical Group Pty Ltd', '', 'With over 100 years in the trade, Greenwood Electrical has the expertise to confidently perform any electrical project, whether small or large.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, '', '394607077', '', '', '', 0, 0, 0, 0, 'http://www.greenwoodelectrical.net.au', 'ABOUT US\n\nGreenwood?', 'A', '{"1":[[0.3125,0.7291666667]],"2":[[0.3125,0.7291666667]],"3":[[0.3125,0.7291666667]],"4":[[0.3125,0.7291666667]],"5":[[0.3125,0.7291666667]]}', '', '', '', '', '', '', 'https://plus.google.com/103575056754855718705/about'),
(3, 'james-thompson-roofing-80203', 'James Thompson Roofing', '', 'If your roof, home, or driveway appear tired and worn, PDT Armour Coating can be of assistance in making your home a possession you can be proud of. We have great expertise in roof restorations.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'info@pdt-coatings.com.au', '477108176', '', '', '', 1, 0, 0, 0, 'http://www.pdt-coatings.com.au', 'We have great expertise in roof restorations and we can clean, rebed & repoint all types of tile roofs and restore your entire roof the state it was in when new.\n\nWe are also experts in all types of concrete resurfacing and sealing along with sealing epoxy flake floors. In addition we specialise in lead and asbestos abatement.\n\nIn short, we offer a full service for all of your roofing, coating, and protective coating needs for both residential and commercial applications. We help to preserve and protect your property and maintain its aesthetic appeal.\n\nWe primarily use very high quality Dulux primers, paints, and protective coatings in all of our work. Dulux products are the highest quality and most trusted protective coating products offered in the Australian marketplace.\n\nPDT Armour Coating is a Dulux accredited and preferred roofer. Which enables us able to warranty our work from Dulux. This gives our clients the peace of mind of knowing our work is backed by Australia?', 'A', '{"1":[[0.291666,0.6875]],"2":[[0.291666,0.6875]],"3":[[0.291666,0.6875]],"4":[[0.291666,0.6875]],"5":[[0.291666,0.6875]]}', 'https://www.facebook.com/PDTCoatings', '', '', '', '', '', ''),
(4, 'icoat-intelligent-roof-coatings-79633', 'iCoat Intelligent Roof Coatings', '', 'Whether you need roof repairs such as re-cementing the ridge capping or would like to transform the appearance of your home with a complete roof restoration, ICOAT Intelligent coatings can help you.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'info@icoatpainting.com.au', '414432626', '', '', '', 0, 0, 0, 0, 'http://www.icoatpainting.com.au', 'For cooler homes, you need the cool roof services of iCoat Intelligent Coatings. We are a locally owned and family operated painting company with over 20 years of invaluable experience, and we are dedicated to our customers.\n\nWhether you are a domestic, commercial or industrial client, our accredited painters and decorators can?', 'A', '{"1":[[0.2916666667,0.7083333333]],"2":[[0.2916666667,0.7083333333]],"3":[[0.2916666667,0.7083333333]],"4":[[0.2916666667,0.7083333333]],"5":[[0.2916666667,0.7083333333]]}', 'https://www.facebook.com/ICOAT-Intelligent-Coatings-834392559947481/', '', '', '', '', '', 'https://plus.google.com/116543978482840797603/about'),
(5, 'greater-shepparton-electrical-services-82675', 'Greater Shepparton Electrical Services', '', 'We have been servicing the Greater Shepparton region for eight years now and guarantee high quality workmanship for all your electrical needs.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'gselectricalservices@outlook.com', '427575350', '', '', '', 0, 0, 0, 0, 'http://www.greatersheppelectrical.com', 'ABOUT\n\nWe are a local business who have serviced the Greater Shepparton region for eight years now. Founder Josh Gray began the company in 2006 with a vision to provide excellent electrical and customer service to his community. Co-Directors Nathan Terlich and Ben Cox have recently taken over the business and are continuing to service the local region with outstanding workmanship and friendly customer assistance. \n\n\nWe are available for 24/7 emergency breakdowns. \n\nWe ensure an immediate response to your call, text or email.\n\nWe guarantee a high quality standard of work.\n\nWe promise excellent customer service.\n\nWe provide free electrical quoting and advice.\n\n\nSERVICES:\n\nDomestic Services\n\nWe carry out all domestic electrical wiring, installation and maintenance, including:\n\n* A/C spilt system installation - we complete both refrigeration and electrical components. This makes installations markably cheaper.\n\n* General lighting and power installation and repair.\n\n* General rewires and renovations.\n\n* Fitting a new home.\n\n* TV antenna and TV point installation.\n\n* Phone & data point wiring.\n\n* Theatre room sound system installation.\n\n* Switchboard upgrade.\n\n* LED lighting installation.\n\n* Ceiling fan installation.\n\n\nCommercial & Industrial Services\n\nWe do all installations and maintenance in the commercial and industrial field. We specialise in:\n\n* Machinery maintenance and fault finding.\n\n* Servicing and installing pump stations.\n\n* Coolrooms installation and maintenance.\n\n* Control panel wiring and upgrades.\n\n* Fruit graders maintenance.\n\n* Fire system installation.', 'A', '{"1":[[0,1]],"2":[[0,1]],"3":[[0,1]],"4":[[0,1]],"5":[[0,1]],"6":[[0,1]],"0":[[0,1]]}', 'https://www.facebook.com/greatersheppelectrical/timeline', '', '', '', '', '', ''),
(6, 'hutchison-roofing-renovations-80031', 'Hutchison Roofing & Renovations', '', 'At Hutchison Roofing and Renovations we understand that building or renovating your home can be very stressful, which is why we endeavour to make our part of the process as hassle free as possible. ', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'hutchisonroofing@live.com', '4187116193', '', '', '', 0, 0, 0, 0, 'http://www.hutchisonroofing.com.au', 'Hutchison Roofing and Renovations is a small family of dedicated roofing professionals ready to take on your residential job. When you choose our team you can be assured that we will provide a comprehensive service and support you every step of the way.  Our services include repair, replace or construct a new roof for your home, warehouse, block of units or shed. If you have a leak or suspect a problem with your roof, don''t risk further damage, let the experts take care of it today.\n\nRefresh your gutters today!\nPoorly maintained guttering can truly affect the appeal of your home, with watermarking and messy spouting lines that work against the look of your home. \n\nHutchison Roofing and Renovations will take care of all damage caused by faulty guttering, we  will replace  gutters and your downpipes with the highest quality products so the benefits will be instant.\n\nHutchison Roofing and Renovations can upgrade or repair your gutter system, optimise your water efficency whilst dramatically improving the look of your home!', 'A', '{"1":[[0.291666,0.6875]],"2":[[0.291666,0.6875]],"3":[[0.291666,0.6875]],"4":[[0.291666,0.6875]],"5":[[0.291666,0.6875]]}', '', '', '', '', '', '', ''),
(7, 'streamline-kitchens-80847', 'Streamline Kitchens', '', 'At Streamline Kitchens & Carpentry we are a family run buissiness we specialise in full kitchen & bathroom renovations and also carpentry projects', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'mario@streamlinekitchens.com.au', '393631344', '', '432787979', '93631544', 0, 0, 0, 0, 'http://www.streamlinekitchens.com.au', 'We understand renovating your existing kitchen is not as easy task. But at Streamline Kitchens we make this task as easy as possible. We not only design and create the kitchen of your dreams, but we can supply and arrange the installation of ovens, cook tops, range hoods and sinks, with our vast network of reliable and professional tradespeople. \n\nConfused? Then come to our showroom, look at our range of kitchens, kitchen hardware and swatches on display and look at the quality materials that we use to manufacture the kitchen. You can also try our range of soft drawers, soft closing doors, lazy susans, pull out and butlers pantries all on display.\n\nApart from Kitchens, Bathrooms and Laundries, Streamline Kitchens can also complete other projects.\n\nThey include:\n\n?', 'A', '{"1":[[0.375,0.7083333]],"2":[[0.375,0.7083333]],"3":[[0.375,0.7083333]],"4":[[0.375,0.7083333]],"5":[[0.375,0.7083333]]}', 'https://www.facebook.com/streamlinekitchens?fref=ts', '', '', '', '', '', 'https://plus.google.com/112093844100196233407/about'),
(8, 'grayling-electrical-82674', 'Grayling Electrical', '', 'Your safety is our priority, to keep you and your family safe from electrical hazards. Our goal is for you to love the results, quality and attention to detail of our electrical work.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'phil@graylingelectrical.com.au', '350211400', '', '', '', 0, 0, 0, 0, 'http://graylingelectrical.com.au', 'Why Choose Grayling Electrical?\n\n1. Safety\n\nSafety of your family is of paramount importance!\nYour safety is our priority, to keep you and your family safe from electrical hazards.\n\n2. Quality Workmanship\n\nIf something is worth doing, it is worth doing right, the first time!\n\nOur goal is for you to love the results, quality and attention to detail of our electrical work!\n\n?', 'A', '{"1":[[0,1]],"2":[[0,1]],"3":[[0,1]],"4":[[0,1]],"5":[[0,1]],"6":[[0,1]],"0":[[0,1]]}', '', '', '', '', '', '', 'https://plus.google.com/115286229705650211928/about'),
(9, 'hamilton-roofing-pty-ltd-79616', 'Hamilton Roofing Pty Ltd', '', 'Hamilton Roofing Pty Ltd was formed by Tim Hamilton to provide a complete metal roofing service to the commercial and domestic market in South East Queensland.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, '', '1800766346', '755984127', '', '1800766347', 0, 0, 0, 0, 'http://www.hamiltonroofing.com.au', 'Hamilton Roofing has been operating as a business on the Gold Coast since 1991. \n \n Our service include the supply and installation of:\n-Metal Roofing in all profiles, including Roof Replacements (Re-Roofs)\n-Metal Fascia and Gutter, including Gutter Replacements (Re-Gutters)\n-Metal Roof Battens, Roof Insulation and Wall Cladding\n-Ventilation and Skylight products\n-Patio and Carport Systems\n-Downpipes\n\n Our commitment to our clients in simple terms is to:\n-Provide prompt competitive pricing and advice at quote stage\n-Commence all work on time\n-Finish the work in the shortest possible time frame\n-Provide a high quality of workmanship and a detailed inspection on completion of all -roofing projects\n-Exceed client expectations in product, service and quality\n-Work hard to build ongoing win - win business with you\n-Honour our commitment to you\n-We will be honest and upfront with you at all times\n-Offer strong 3 tiered product and installation warranty\n\nA very stable workforce has been a major element in the success of Hamilton Roofing since inception.', 'A', '{"1":[[0.25,0.7083333333]],"2":[[0.25,0.7083333333]],"3":[[0.25,0.7083333333]],"4":[[0.25,0.7083333333]],"5":[[0.25,0.7083333333]]}', '', '', '', '', '', '', 'https://plus.google.com/113900983003108807747/about'),
(10, 'squirrel-home-improvements-80972', 'Squirrel Home Improvements', '', 'Squirrel Home Improvements (SHI) has been a registered building company for over 30 years. We have been exceeding in the residential industry dealing with human resources and meeting their expectation', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, '', '477322472', '', '', '', 0, 0, 0, 0, 'http://squirrelhomeimprovements.com.au', 'Squirrel Home Improvements (SHI) has been a registered building company for over 30 years. We have been exceeding in the residential industry dealing with human resources and meeting their expectations with a high quality workmanship that is second to none.\n\nAs a building company we strive for client satisfaction by delivering projects on time, on their budget. It is very important to us that client needs are met with the highest integrity.\n\nAs a building company we have done a rage of extensive works from, new homes, new kitchens, new bathrooms, Decks, Pergolas, and Insurance works, along with small maintenance jobs and small commercial jobs. Please feel free to view our gallery.', 'A', '{"1":[[0.375,0.7083333]],"2":[[0.375,0.7083333]],"3":[[0.375,0.7083333]],"4":[[0.375,0.7083333]],"5":[[0.375,0.7083333]]}', '', '', '', '', '', '', ''),
(11, 'stella-design-90500', 'Stella Design', '', 'A full-serivce agency in Sydney, we offer Brand Design & Strategy, Graphic Design, Logo Design, Website Design & Development, eCommerce, Marketing.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'info@stelladesign.com.au', '289737509', '', '', '', 0, 0, 0, 0, 'http://www.stelladesign.com.au/', 'Stella Design has been making a difference for over eight years. We have grown year on year every one of those last eight years because of the ongoing success of our clients. We are a collaboration of creative skills, business acumen and marketing know how.\n\nWe build brands. We design, develop and maintain websites. We design arresting print campaigns and collateral. We understand how to make your corporate communication tasks interact on every level with your intended audience. Your brand experience for a customer should be inviting, attractive, compelling and actionable.\n\nBrand Identity flows through graphic design, web design, web development and print or collateral communication in a logical, arresting and persuasive fashion. We can provide marketing assistance across the board:\n\n* Brand development\n* Strategy and Development\n* Marketing Consulting and Services\n* Collateral and Publication Design\n* Online and Website Development\n* Search Engine Marketing\n\nAs you might expect in such a results driven business, clients only come back if they''ve achieved the results they''re after. Our retention rate is a staggering 93%. A recent customer satisfaction survey showed that 96% of our clients said we exceeded their expectations. We''re happy for you to decide. If you think we might be the right choice for your company we invite you to have an initial, free, consultation with us to see what we can do.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/StellaDesign', 'https://twitter.com/stella_design', 'https://www.linkedin.com/company/stella-design', '', '', 'https://www.pinterest.com/stelladesignsyd/', 'https://plus.google.com/105661523299208946903/about'),
(12, 'prestige-framing-90499', 'Prestige Framing ', '', 'Prestige Framing have over 20 years?', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, '', '296802732', '', '', '', 0, 0, 0, 0, 'http://www.prestigeframing.com.au/', 'Prestige Framing have over 20 years?', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/prestige.framing', '', '', '', '', '', 'https://plus.google.com/112189631558117225226/about'),
(13, 'connect-thinking-alison-bickford-90498', 'Connect Thinking: Alison Bickford', '', 'We will help uncover your needs and ask the right questions before you commit your e-learning, LMS or social media budget.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, '', '299883412', '', '', '', 0, 0, 0, 0, 'http://connectthinking.com.au/', 'We will help you to:\n\nImplement best practice\nEnsure adult learning principles\nImprove design methodologies\nChoose the right tools\nProject manage to time, cost and quality\nEvaluate outcomes', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', 'https://twitter.com/connectthinking', 'https://www.linkedin.com/in/connectthinking', '', '', '', ''),
(14, 'networking-business-clubs-86252', 'Networking Business Clubs', '', 'NBC Financial Services was established in 1991 by John Northwood, Jim Barton and David Crase to provide insurance services to the local community and surrounds.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'manager@nbcfinserv.com.au', '410635147', '', '', '', 0, 0, 0, 0, 'http://www.nbcfinserv.com.au', 'NBC Financial Services was established in 1991 by John Northwood, Jim Barton and David Crase to provide insurance services to the local community and surrounds. In September 1991 Denis Procter joined NBC to develop the financial planning arm of the business, while David specialised in risk insurance. Denis and David successfully developed their business and in 2004 were joined by Rex Whittaker to take over from Denis who retired.\n\nRex and David operated until 2007 at which time David decided to retire. Sharon Fox joined the team in 2008 as a Paraplanner and is now a Financial Adviser.\n\nIn 2008, NBC struck up a strategic alliance with AWM Consultants in Naracoorte. Both Rex and Sharon provide financial advice to clients referred to us by AWM. We travel to Naracoorte and consult in AWM''s offices in the Main Street.\n\nIn 2009, we moved to our refurbished, modern offices on George Street. At this time we became registered tax agents and NBC Accounting Services commenced to provide a complementary service to our financial planning and general insurance clients.\n\nJuly 2012 saw us open a second office in Mount Gambier where Rex is now based for three days a week, sharing an office with long term tax agent Terry Scott.\n\nWe have extended the services and geographical scope of our business and are well equipped to provide accounting and financial planning advice throughout the South East.', 'A', '{"1":[[0.375,0.7291666667]],"2":[[0.375,0.7291666667]],"3":[[0.375,0.7291666667]],"4":[[0.375,0.7291666667]],"5":[[0.375,0.7291666667]]}', '', '', '', '', '', '', ''),
(15, 'graham-stenhouse-electrical-contractors-82672', 'Graham Stenhouse Electrical Contractors', '', 'We handle all electrical needs in Commercial, Domestic and Industrial, including split systems, data, security cameras, switchboard upgrades, solar installation and much more!', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'graham@gbselectrical.com.au', '395355777', '', '', '395355701', 0, 0, 0, 0, 'http://www.gbselectrical.com.au', 'About Us\n\nGraham Stenhouse established the business "G B Stenhouse Electrical Contractors" in 1969 with the belief that the needs of the customer are of the utmost importance.\n \nWe are committed to meeting those needs and as a result, a high percentage of our business is from repeat customers and referrals.\n\nWe would welcome the opportunity to earn your trust and deliver to you, the best service in the industry.\n\nSERVICES\n\nCommercial\n\n* Sub switchboards\n* Wire in new machines\n* Data cabling\n* Refit or change over old switchboards to a new switchboard\n* New Hi-Bay lighting\n* New mains\n* Solar Power\n* New 3-phase outlets\n\nDomestic\n\n* New switchboards and mains\n* Rewire houses\n* Solar Power\n* Extra power points\n* Extra lights\n* Exhaust fans\n* Wire in ovens\n* Wire in hot plates\n* Data cabling\n* Install split air conditioning systems\n* Weatherproof power points\n* Garden lighting\n* Pool, spa & sauna wiring\n* Much more\n\nIndustrial\n\n* Wire in new machines\n* Data cabling\n* Sub switchboards\n* Refit or change over old switchboards to a new switchboard\n* New Hi-Bay lighting\n* New mains\n* Solar Power\n* New 3-phase outlets\n* Much More', 'A', '{"1":[[0.375,0.708333333]],"2":[[0.375,0.708333333]],"3":[[0.375,0.708333333]],"4":[[0.375,0.708333333]],"5":[[0.375,0.708333333]]}', '', '', 'https://au.linkedin.com/pub/graham-stenhouse/78/470/585', '', '', '', 'https://plus.google.com/110553924441399262936/about'),
(16, 'guardian-roof-restoration-pty-ltd-80067', 'Guardian Roof Restoration Pty Ltd', '', 'Brisbane''s highest quality roof restorations at an affordable price. 25 years experience, fully licensed and insured with 10 years warranty.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'guardianroof@live.com', '732977655', '', '411371365', '', 0, 0, 0, 0, 'http://www.guardianroof.com.au', 'South East Queensland''s highest quality roof cleaning, re-pointing, sealing and coating. \n\nOur services include:\n-Residential and Commercial roof cleaning, coating and repairs.\n-Any roof surface - metal, tile , asbestos, decramastic and terracotta\n-changing of broken or cracked tiles\n-High Pressure cleaning of roof and driveways\n-Gutter clearing and gutter guard installation\n-Whirly-Bird and roof vent installation\n-Application of protective and reflective coatings\n-mold treat and anti fungicide roof wash\n-re-bed and re-pointing\n-Insulation installation', 'A', '{"1":[[0.291666,0.6875]],"2":[[0.291666,0.6875]],"3":[[0.291666,0.6875]],"4":[[0.291666,0.6875]],"5":[[0.291666,0.6875]]}', 'https://www.facebook.com/roofpaintbrisbane?fref=ts', '', '', '', '', '', ''),
(17, 'go-lightly-electrical-services-82664', 'Go Lightly Electrical Services', '', 'Go Lightly Electrical specialises in domestic, commercial and industrial electrical services and climate control, including air conditioning.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'trent@golightlyelectrical.com.au', '439594490', '', '', '', 0, 0, 0, 0, 'http://www.golightlyelectrical.com', 'ABOUT US\n\nGo Lightly Electrical Services was established in response to the need for an environmentally conscious electrical service, which also provides a more comprehensive service experience. \n\nGo Lightly Electrical Services is a locally owned, innovative electrical service that provides quality service and workmanship.\n\n\nELECTRICAL SERVICES\n\n* Domestic\n\n- Rewires\n- Switchboard Change Over\n- Range Hood and Mechanical Ducting Service\n- Establish Underground Supplies\n- Assessment, Design and Fit Off for New Homes\n- Energy Smart Audits\n- New Connections\n\n* Commercial\n\n- Asset Management\n- Energy Smart Audits\n- Shop and Factory Fit Outs\n- Data and Voice Services\n- Voice Over Internet Protocol (VoIP)\n- New Connections\n\n* Industrial\n\n- Motor Control\n- Programmable Logic Control (PLC) design and installation\n- Programed Maintenance\n- Optimised Up-Time Solutions\n- Energy Smart Audits\n- Breakdown Service\n- New Connections\n- Temporary Power Supplies / Generators\n\n\nGo Lightly Electrical specialises in domestic, commercial and industrial electrical services and climate control, including air conditioning.', 'A', '{"1":[[0.2916666667,0.75]],"2":[[0.2916666667,0.75]],"3":[[0.2916666667,0.75]],"4":[[0.2916666667,0.75]],"5":[[0.2916666667,0.75]],"6":[[0.2916666667,0.75]]}', 'https://www.facebook.com/Go-Lightly-Electrical-Services-466207970187468/', '', '', '', '', 'https://www.pinterest.com/golightlyelectr/', 'https://plus.google.com/106548626276723152991/about'),
