(19, 'the-auto-clearance-centre-90497', 'The Auto Clearance Centre', '', 'The Auto Clearance Centre is operated by some of the car industrys most experienced people.\n', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'sales@theautoclearancecentre.com.au', '410526325', '', '', '', 0, 0, 0, 0, 'http://www.theautoclearancecentre.com.au/', 'The Auto Clearance Centre is operated by some of the car industrys most experienced people.\n\nOur service was started on the belief - why should someone pay huge money for a great vehicle when you can get the same thing with a minor bingle and have it fixed and on the road for less than half the going rate? \n\nWe are passionate about what we offer our customers so we hand pick our vehicles and aim to sell vehicles with as minimal damage as possible.\n\nAt the Auto Clearance Centre we sell HEAPS of vehicles each month and we operate on high turnover instead of high profit. Because of this we can offer you the champagne taste with a beer budget. Even tyre kickers walk out with a deal.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/The-Auto-Clearance-Centre-112075418866764/', '', '', '', '', '', ''),
