(23, 'shanghai-group-australia-pty-ltd-sga-furniture-90496', 'Shanghai Group Australia Pty Ltd (SGA furniture)', '', 'Shanghai Group Australia Furniture (SGA furniture) is a registered Australian company specializing in the field of import and export of top quality furniture products.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'info@sgaust.com.au', '296309988', '', '', '', 0, 0, 0, 0, 'http://www.sgaust.com.au/', 'Shanghai Group Australia Furniture (SGA furniture) is a registered Australian company specializing in the field of import and export of top quality furniture products and services between Australia and China.\nSGA furniture is established to facilitate the every growing demands of the Australian Furniture market for top quality imported products. SGA furniture can source products and channels of distribution for you and offer complete delivery and logistic services from China directly to your warehouse or stored in our warehouses around Australia wide. SGA furniture intends to provide a conduit through which products of high quality, value and relevant aesthetic taste will flow through to your potential clienteles for the benefit for all stakeholders', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
