(25, 'gills-roof-restorations-80131', 'Gills Roof Restorations', '', 'Gills Roof Restorations provide roof repair services throughout Brisbane and the Gold Coast, specialising in high pressure roof cleaning and roof restoration. ', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'gillsroofrestorations@gmail.com', '455845311', '', '', '', 0, 0, 0, 0, 'http://Www.gillsroofrestorations.com.au', 'Gills Roof Restorations are specialists in a variety of roof restoration and repair services. We are experts in high pressure cleaning, and will have your roof or driveway sparkling again in no time.\n\nBased in Sunnybank, we have a wide service range of up to 50km and are happy to travel throughout Brisbane and surrounding areas, including Redland Bay, Kenmore and Arundel.\n\nAt Gill''s Roof Restorations, we pride ourselves on our professional work ethic and quality roofing services. We strive to provide immaculate finishes on all our services from driveway and gutter cleaning, to roof restorations and painting.\n\nGill''s Roof Restorations offer a range of professional services. From high pressure roof and driveway cleaning, to broken tile replacement, we are fully qualified and experienced to reliably and honestly complete any roof restoration project.\n\nIf you?', 'A', '{"1":[[0.2916666667,0.7083333333]],"2":[[0.2916666667,0.7083333333]],"3":[[0.2916666667,0.7083333333]],"4":[[0.2916666667,0.7083333333]],"5":[[0.2916666667,0.7083333333]]}', 'https://www.facebook.com/Gills-Roof-Restorations-855377194528158/', '', '', '', '', '', 'https://plus.google.com/100342031520858619532/about'),
(26, 'r-j-juniper-80946', 'R J Juniper', '', 'R J Juniper is proud to offer a variety of professional construction services and advice in the Bendigo reign. We are focused on delivering every project in a timely fashion.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'r721071@bigpond.net.au', '419892004', '', '', '', 0, 0, 0, 0, 'http://www.rjjuniper.com.au', 'We provide superior quality services and long lasting solutions to clients in the residential, domestic and commercial.\n\nWhatever the scale and specific requirements of your project, R J Juniper will provide cost effective solutions and aim to exceed all expectations.\n\nOur services:\n\nEvery great idea falls short if it is not backed up by great execution. Our experts will assist you in creating your financial plan, choosing the right materials, creating the design and executing your vision, so your project will be completed on time, within your budget and to above expectations.\n\n?', 'A', '{"1":[[0.375,0.7083333]],"2":[[0.375,0.7083333]],"3":[[0.375,0.7083333]],"4":[[0.375,0.7083333]],"5":[[0.375,0.7083333]]}', '', '', '', '', '', '', 'https://plus.google.com/109355973690313719442/about'),
(27, 'gc-roof-and-gutter-repairs-79975', 'GC Roof and Gutter Repairs', '', 'GC Roof and Gutter Repairs specialise in the replacement and repair of metal roof gutters, downpipes and metal roof repairs on the Gold Coast. Quality installations and repairs at affordable prices.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'gcroofandgutter@gmail.com', '431433474', '', '', '', 0, 0, 0, 0, 'http://www.gcroofandgutter.com.au', 'Specialising in metal roofing repairs from Tweed Heads on the Gold Coast right through to the Brisbane River in the north. We are the experts at finding the cause of any roof leak and most importantly fixing that roof leak in the most cost effective way.\nGC Roof and Gutter Repairs are experts in flashing repairs including lead, aluminium and steel. Our experienced roofing tradesmen can provide you with quality advice and solutions to solve any roofing issue you may have.  \n\nHere at GC Roof and Gutter Repairs it''s not just roofing that we can help you with. Replacing rusting or leaking gutters is also a specialty for our experienced roofing tradesmen. We can replace your rusted or leaking gutter with new colourbond gutters and downpipes available in a wide range of colours to suit all house styles. Downpipe replacements are also available in both colourbond and PVC whichever is your preference. Call us today for an obligation free quote on any roofing or gutter repair on the Gold Coast and Southside of Brisbane.\n\nThe most cost effective way to control the climate in your home. Call us today or request an online quote.', 'A', '{"1":[[0.2916666667,0.7083333333]],"2":[[0.2916666667,0.7083333333]],"3":[[0.2916666667,0.7083333333]],"4":[[0.2916666667,0.7083333333]],"5":[[0.2916666667,0.7083333333]],"6":[[0.2916666667,0.7083333333]],"0":[[0.2916666667,0.7083333333]]}', 'https://www.facebook.com/GCRoofandgutterrepairs?fref=ts', '', '', '', '', '', 'https://plus.google.com/104333831003008040471/about'),
(28, 'garden-city-roofing-79983', 'Garden City Roofing', '', 'If you have a leaking roof or gutters, or are looking to upgrade to a more modern roofing design, call the roofing and gutter experts at Garden City Roofing.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'gedser@internode.on.net', '439725265', '', '', '', 0, 0, 0, 0, 'http://www.gardencityroofing.com.au', 'With our many years of experience, Garden City Roofing are your roofing experts. Our professional staff, quality materials and affordable rates make us the industry leader in Toowoomba for all your roofing needs. We can restore your roof to its former glory, fix any annoying leaks and repair storm damage to roof, skylights or whirlybirds.\n\nWe are also certified to perform Asbestos Removal safely, professionally and efficiently. Based in Toowoomba, we have many years of experience in the industry and are here to provide you with excellent workmanship every time.\n\nOur expert team have the know-how to successfully complete any job to the highest standards, and can be relied upon to provide prompt and professional service every time.\n\nWhat we offer\nGarden City Roofing offers a wide range of roofing and gutter services to local Toowoomba property owners, including:\n\n-Re-roofing\n-Guttering replacement\n-Asbestos removal\n-Roof restoration\n-Gutter clean-outs\n-Roof installation\n-Skylights\n-Whirlybirds\n-Insulation\n-Waterproofing\n-Cleaning\n\nEach service that we offer is undertaken with the utmost care and precision. You can rest assured knowing that when you hire Garden City Roofing for your roofing and gutter work, it is being handled by the roofing and gutter experts.\n\nOur Reputation\nGarden City Roofing has developed a reputation amongst the local Toowoomba community for providing efficient, trustworthy and affordable roof and gutter construction or repair services.\n\nOur many satisfied clients in the Toowoomba area are testament to the quality of our workmanship. We are passionate about going above and beyond the call of duty to ensure the complete safety, security and comfort of your property. We are the roofing professionals of choice in Toowoomba.\n\nFor more information, please feel free to contact us and one of our consultants will assist you further.', 'A', '{"1":[[0.2916666667,0.7083333333]],"2":[[0.2916666667,0.7083333333]],"3":[[0.2916666667,0.7083333333]],"4":[[0.2916666667,0.7083333333]],"5":[[0.2916666667,0.7083333333]]}', 'https://www.facebook.com/Garden-City-Roofing-499925740100514/timeline/', '', '', '', '', '', 'https://plus.google.com/110128148710095790979/about'),
(29, 'purely-bathroom-renovations-80756', 'Purely Bathroom Renovations', '', 'Purely Bathroom Renovations strive to meet all the needs and preferences of their clients; they are happy to use materials supplied by customers.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'purelybathrooms@live.com.au', '416063884', '', '', '', 0, 0, 0, 0, 'http://www.purelybathrooms.com.au', 'Purely Bathroom Renovations specialises in renovating and building the perfect bathroom to suit your individual needs and budget. They pride themselves on providing professional quality workmanship in a timely manner; they understand the importance of having your project completed as quickly as possible. Their tradesmen are fully qualified with over 15 years experience behind them. You can be assured that your project will be completed to the highest standards and will deliver an outcome you will be thoroughly satisfied with.  \n\nThe team includes all required trades, including Carpenters, Plumbers, Painters and Tilers. They offer a free discussion and quoting service for your project; they have consistently demonstrated very competitive pricing and exceptional quality of work. Purely Bathroom Renovations strive to meet all the needs and preferences of their clients; they are happy to use materials supplied by customers. Of course they can suggest and supply an extensive range of options and alternatives for use in your project to achieve the ideal look and design for you. All work completed is of outstanding quality and is fully guaranteed.', 'A', '{"1":[[0.375,0.7083333]],"2":[[0.375,0.7083333]],"3":[[0.375,0.7083333]],"4":[[0.375,0.7083333]],"5":[[0.375,0.7083333]]}', '', '', '', '', '', '', 'https://plus.google.com/111432647121650024505/about'),
(30, 'virtual-intelligence-90495', 'Virtual Intelligence', '', 'Virtual Intelligence (VIS) is an Australian owned company that specialises in providing tailored corporate surveillance and factual investigations for International Insurance Corporations.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, '', '296300077', '', '', '', 0, 0, 0, 0, 'http://www.virtualintelligence.com.au/', 'Virtual Intelligence (VIS) is an Australian owned company that specialises in providing tailored corporate surveillance and factual investigations for International Insurance Corporations, Multinational Self Insurers as well as a wide range of Insurance Brokers and Legal Firms.\n\nVIS specialises in a variety of fields ranging from Insurance matters that includes but is not limited to, Workers Compensation, Personal Injury and Public Liability, as well as Internal HR Investigations and a variety of Litigated Matters. VIS is a proven and tested provider of corporate surveillance and factual investigations having over 20 year?', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
(31, 'gamlin-roofing-79699', 'Gamlin Roofing', '', 'Whatever the size, whether it''s new or a re-roof, or specialist product type required, Gamlin Roofing is the team to put on top of your project !', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'info@gamlinroofing.com.au', '754555255', '', '', '754555211', 0, 0, 0, 0, 'http://www.gamlinroofing.com.au', 'Gamlin Roofing is a family owned and operated roofing company which began in Noosa in 1988. We service the entire Noosa and Sunshine Coast region from our head office based in Noosaville, with a friendly "Family values" attitude plus a commitment to quality.\n\nCommercial Roofing\nGamlin Roofing prides itself on our commercial roofing projects. We have extensive commercial building experience including: Units Complexes / Highrises, Shopping Centres, Schools, Community Centres and Warehouses.\n\nAt Gamlin Roofing we regularly utilise unique products such as:\n\n?', 'A', '{"1":[[0.2916666667,0.6666666667]],"2":[[0.2916666667,0.6666666667]],"3":[[0.2916666667,0.6666666667]],"4":[[0.2916666667,0.6666666667]],"5":[[0.2916666667,0.6666666667]]}', 'https://www.facebook.com/Gamlinroofing?fref=ts', '', '', '', '', '', 'https://plus.google.com/115667594448192507659/about'),
(32, 'gary-schmidt-electrical-contractor-82654', 'Gary Schmidt Electrical Contractor', '', 'Gary Schmidt Electrical carries out repairs and maintenance to hot water systems, stoves, air conditioners as well as specialising in lighting, ceiling fans, voice and data cabling, security systems.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'gary@gselectrical.com.au', '350321340', '', '', '', 0, 0, 0, 0, 'http://www.garyschmidtelectrical.communityguide.com.au', 'Gary Schmidt Electrical specialises in all types of industrial, commercial and domestic electrical work.\n\nWe are located in Swan Hill, Victoria and service Swan Hill and the district.\n\nGary Schmidt Electrical carries out repairs and maintenance to hot water systems, stoves, air conditioners as well as specialising in lighting, ceiling fans, voice and data cabling, security systems and more.\n\nGary Schmidt Electrical specialises in all types of:\n\n* Industrial electrical work\n* Commercial electrical work\n* Domestic electrical work\n\nWe are located in Swan Hill, Victoria and service Swan Hill and the district.\n\nGary Schmidt Electrical also offers:\n\n* Repairs and maintenance to hot water systems, stoves, air conditioners\n* Agents for Aussie Vac ducted vacuum systems\n* Huge range of lighting and ceiling fans\n* Samsung dealer for business telephone systems\n* Voice and data cabling\n* Security systems\n* Floor heating\n* Scissor lift for hire', 'A', '{"1":[[0.375,0.708333333]],"2":[[0.375,0.708333333]],"3":[[0.375,0.708333333]],"4":[[0.375,0.708333333]],"5":[[0.375,0.708333333]]}', '', '', '', '', '', '', 'https://plus.google.com/117636399387876853691/about'),
(33, 'portland-home-improvements-81009', 'Portland Home Improvements', '', 'Portland Home Improvements is a family business established by David and Meredith Fredericks in 1984 concentrating on custom joinery and heritage restorations.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'portlandhome@bigpond.com', '355233066', '', '', '355234117', 0, 0, 0, 0, 'http://www.portlandhomeimprovements.com.au', 'In 1999 the business moved to its premises at 40 Barkly Street, South Portland and expanded to include glass and aluminium fabrication and now operates from a modern showroom and workshop at 40 Barkly Street, Portland where its workforce of qualified tradesmen is kept busy preparing kitchens and furniture for all budgets and decors. \n\nPortland Home Improvements is a member of the Housing Industry Association Kitchens and Bathrooms division and prides itself on quality workmanship that gives its customers long and lasting value from their renovation dollars.\n\nIn contrast to using the latest trends and products for modern and practical kitchens, bathrooms and furniture, Portland Home Improvements joinery workshop is regularly restoring windows, doors and other furniture of Portland''s heritage buildings and has several times been recognized through Heritage Awards.', 'A', '{"1":[[0.3333333333,0.7083333333]],"2":[[0.3333333333,0.7083333333]],"3":[[0.3333333333,0.7083333333]],"4":[[0.3333333333,0.7083333333]],"5":[[0.3333333333,0.7083333333]],"6":[[0.3333333333,0.7083333333]]}', 'https://www.facebook.com/portlandhomeimprovements?fref=ts', '', '', '', '', '', 'https://plus.google.com/111611453084573880238/about');
