(34, 'fussy-roof-restoration-80112', 'Fussy Roof Restoration', '', 'Fussy Roof Restorations highly skilled family run business provides quality, reliability and a guarantee to all works under taken and services exclusively the Gold Coast, Brisbane &; Sunshine Coast.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'info@fussyroofrestorations.com.au', '1300734302', '', '410631411', '', 0, 0, 0, 0, 'http://www.fussyroofrestorations.com.au', 'Is your roof looking tired? Are you desperately trying to find a way to breathe new life into your roof? If this situation perfectly describes your roof then perhaps you need to consider investing in painting your roof.\n\nRoof painting is a great way to bring your roof to life, while at the same time improving the overall value of your property.\n\nHowever, before you go out and grab some paint from your local hardware store, you should consider having the task handled by Fussy Roof Restorations.\n\nIf you are thinking about doing-it-yourself or flipping through your local directory to find the nearest roofing company, stop and focus instead on finding a company such as Fussy Roof Restorations that specializes in Roofing solutions. Why use a professional company to paint your roof? For starters you do not want to have your tired looking roof painted only to realize weeks later that your roof needs repairing, or better yet only to realize that your roof may not have needed to be painted but cleaned instead. Having professional roof painters inspect your roof (FOR FREE) is therefore essential and using the services of Fussy Roof Restorations has its benefits.\n\nBenefits of using the services of Fussy Roof Restorations\n\n-They get the job done once, and on time\n-They use only the highest quality paints that will give you a high quality finish that will last for years\n-They will give you a written warranty that covers all workmanship for 10 years\n-They will provide you with a free roof inspection that is valued at $180\n-They will beat any written quote by 10%\n-They offer interest free payment terms\n-You will have direct contact with the owner Alistir (unlike other larger more informal companies)\n\nFussy Roof Restorations highly skilled roof painters have the ability to coat any type of roof: colorband, concrete, asbestos, tile, terracotta, fiber tile and metal. You name it and we will paint it.\n\nYou will also be happy to know that Fussy Roof Restorations is not only a company that provides Gold Coast, Brisbane & Sunshine Coast residents with exceptionally skilled roof painters; they are also your one stop shop for all your roofing needs.\n\nSome of the other services that they offer are:\n-Roof Restorations\n-Roof Repairs\n-Roof Repainting\n-Roof Cleaning\n-Exterior Painting\n-Repainting\n-Water Leaks\n\nSo for all your roofing requirements, please don?', 'A', '{"1":[[0.25,0.75]],"2":[[0.25,0.75]],"3":[[0.25,0.75]],"4":[[0.25,0.75]],"5":[[0.25,0.75]],"6":[[0.25,0.75]],"0":[[0.25,0.75]]}', 'https://www.facebook.com/fussyroofrestorations', '', '', '', '', '', 'https://plus.google.com/+FussyRoofRestorationBroadbeachWaters/posts'),
(35, 'urban-floors-australia-90494', 'Urban Floors Australia', '', 'We are a professional, local Melbourne company that offers an extensive range of awesome, contemporary, seamless, concrete flooring finishes for our home, business or industrial environment.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'sales@urbanconcretefloors.com.au', '394671167', '', '', '', 0, 0, 0, 0, 'http://www.urbanconcretefloors.com.au/', 'At Urban Floors, we recognize that every project is unique, which is why we offer a range of flooring \nfinishes to suit your specific requirements. \n\nYou can choose from a range of finishes that make your floor look like ''polished \nconcrete'' - and we CAN GO OVER your timber or tiles.\n\nThe products we use for our finishes are sourced from around the world including the USA, Germany \nand locally from Australia, which means they are high quality, have withstood the test of time and are subject to stringent guidelines.\n\nIt also means that with our extensive range of products and finishes, we will apply the best flooring solution for your needs.\n\nAs part of our flooring installations we can also offer epoxy, glue and tile removal and floor levelling. \n\nOur team are professional, on time, respectful of your surrounds and time constraints and we have industry required, public liability cover.   We carry a range of machines, vaccums and edge grinders to ensure that the appropriate equipment is allocated to your project, resulting in a high quality finish and to your schedule.   ', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/Urban-Floors-545076445569499/', '', '', '', '', 'https://www.pinterest.com/urbanflooring/', 'https://plus.google.com/104100874770212780992/about'),
