(39, 'dynamic-bradview-roofing-pty-ltd-79988', 'Dynamic Bradview Roofing Pty Ltd', '', 'Dynamic Bradview Roofing supplies and installs quality metal roofing products to domestic and commercial building contractors in South East Queensland: Brisbane, Sunshine Coast, Gold Coast to Ipswich.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'sales@dynamicbradview.com.au', '732845009', '', '', '739111268', 0, 0, 0, 0, 'http://www.dynamicbradview.com.au', 'Dynamic Bradview Roofing Pty Ltd supplies and installs quality metal roofing products for domestic and commercial building contractors.\n\nOur clients enjoy the following benefits:\n\n-Competitive Pricing\nWe''re a supplier with buying power and recognise the mutual benefit in a stable and competitive pricing structure.\n\n-Reliable Supply\nWe understand the time pressures of the building industry - and commit ourselves to reliably delivering an ''on time'' quality product.\n\n-Superior Service\nWe place our reputation above all else. From start to finish and beyond, we take care of our clients.\n\nA quick glance through our Gallery of recently completed work will leave you in no doubt as to Dynamic Bradview''s capability in the competitive market of metal roofing.\n\nContact us and we''ll explain how twenty years experience in the metal roofing business equips us to deliver superior products and service to our many repeat customers.', 'A', '{"1":[[0.375,0.6666666667]],"2":[[0.375,0.6666666667]],"3":[[0.375,0.6666666667]],"4":[[0.375,0.6666666667]],"5":[[0.375,0.5833333333]]}', '', '', '', '', '', '', 'https://plus.google.com/110839295199674447104/about'),
