(42, 'simplicity-kitchens-80886', 'Simplicity Kitchens', '', 'Simplicity Kitchens is a family operated business offering unbeatable customer service, award winning kitchen solutions, and a dedicated team focused on bring your dream kitchen to life.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'info@simplicitykitchens.com.au', '262424633', '', '', '262424677', 0, 0, 0, 0, 'http://www.simplicitykitchens.com.au', 'Simplicity Kitchens has been established since January 2001 and 14 years on have proven to be an innovative leader in the kitchen industry. We take great pride in producing some of Canberra''s finest joinery, and this has been demonstrated by winning multiple awrds in both the Housing Industry Association and the Master \nBuilders Association whilst our apprentices have won a variety of awards whilst training at the Canberra Institute of Technology. Since 2005 we have won more awards than any other Joinery in the Canberra region.\n\nSimplicity Kitchens is a family operated business offering unbeatable customer service, award winning joinery solutions, and a dedicated team focused on delivering the result that you as a client expect. Simplicity Kitchens offer full trade management using only qualified trades whilst all our Joinery is installed by in house staff ensuring an outstanding result every time.\n\nWe are constantly sourcing the latest in products and materials combining them with an up to date manufacturing facility giving you the client the confidence in knowing that we will deliver the quality product that you are looking for. We offer a comprehensive Showroom displaying a wide variety of products and styles to help you in achieving that individual result that you are sure to be pleased with for years to come.', 'A', '{"1":[[0.4166666667,0.6666666667]],"2":[[0.4166666667,0.6666666667]],"3":[[0.4166666667,0.6666666667]],"4":[[0.4166666667,0.6666666667]],"5":[[0.4166666667,0.6666666667]],"6":[[0.375,0.5]]}', '', '', '', '', '', '', 'ht