(43, 'fourth-phase-electrics-pty-ltd-82645', 'Fourth Phase Electrics Pty Ltd', '', 'Fourth Phase Electrics is an electrical contracting company based in the eastern suburbs of Melbourne. We provide service to all areas and industries.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'casey@fourthphaseelectrics.com.au', '430198349', '', '', '', 0, 0, 0, 0, 'http://www.fourthphaseelectrics.com.au', 'Fourth Phase Electrics is an electrical contracting company based in the eastern suburbs of Melbourne. We pride ourselves on our passion for the industry, and the commitment we make to all of our clients. \n\nWe provide solutions to all electrical requirements, in all industries - Commercial, Industrial, Mechanical, Domestic and Rural. \n\nWe work hard with our suppliers to provide the highest quality materials, at competitive pricing. \n\nWe can provide cost effective solutions to the following aspects;\n\n* New machine installations\n* Mains upgrades\n* Switchboard installations and upgrades\n* 24/7 emergency breakdowns and repairs\n* Thermal imaging\n* Rewires\n* All general power and lighting\n* Energy efficient lighting solutions\n* General machinery preventative maintenance and testing\n* Office refurbishment\n* Testing and Tagging\n\nWe realise how important it is to get your factory/office/house back to normal, and causing the least amount of disruptions. We are more than happy to liaise with all our clients to find the right time to undertake the works - whether that be employees'' RDO''s, weekends or overnight shutdowns. \n\nAll our tradespeople are fully licensed and trained, and publicly insured for $20million, so you know you are in safe hands. \n\nWe look forward to the opportunity of working with you, and if you have any questions or queries, please do not hesitate to call us on 0430198349.', 'A', '{"1":[[0.375,0.708333333]],"2":[[0.375,0.708333333]],"3":[[0.375,0.708333333]],"4":[[0.375,0.708333333]],"5":[[0.375,0.708333333]]}', 'https://www.facebook.com/fourthphaseelectrics/timeline', '', '', '', '', '', ''),
(44, 'diamond-roof-tiling-restoration-80072', 'Diamond Roof Tiling & Restoration', '', 'As roof restoration and roof repair specialists for over 20 years, our extensive experience offers services that cater to every type of roof tile, regardless of materials or designs.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'info@diamondrooftiling.com.au', '413559693', '', '', '', 0, 0, 0, 0, 'http://www.diamondrooftiling.com.au', 'Diamond Roof Tiling and Restoration provide cost-effective, high quality roofing solutions that are precisely tailored to the exact needs and conditions of your roof. Diamond Roof Tiling and Restoration help protect your most valuable asset and that is your home.\n\nYou''ll find Diamond Roof Tiling and Restoration personnel very friendly, prompt, and professional in our approach and workmanship. We listen to your needs, take care of any special considerations, and work quickly and efficiently, leaving your roof and most importantly your home or business, repaired, taken care of and neat and tidy when work is completed. Your absolute satisfaction helps build our reputation and business.\n\nRoof Cleaning & Roof Painting Brisbane\nAre you facing a leaky roof problem? Do you want to undertake an extensive roofs repair? Are you looking for experienced roofing specialists in the Brisbane area? Do you reside in an old building and are you contemplating roof restorations by any well-known roofer? Is your roof looking dull and seems to have lost its lustre? Sometimes, do you think that a paint job, or a thorough cleaning and washing would make the roof look as good as new?\n\nYes. The options are plenty, but the onus is on us to make the right choice when it comes to our home or building. The roof is definitely the most important part of a building. Therefore, we have to pay special attention to its general upkeep and regular maintenance. Many a time, depending upon the requirement and the situation, we may engage roofers to clean, carry out a roof painting service or take care of the leaks and cracks by going in for repairs or go in for a complete makeover with restoration.\n\nSo in the Brisbane area, who do you think is well-equipped to handle a roof restoration, repairs, cleaning and painting service? Don''t look beyond the Diamond Roof Tiling Company. With over two decades of experience as competent and established roof restoration and roof repairs specialists in Brisbane, we are more than suited to undertake any form of work that entails roofs. Be it roof tiling, repairing, cleaning, washing, painting, glazing or even go in for a roof restoration project, we undertake all of this and more.\n\nSo, the next time you are looking for experienced roof specialists in Brisbane, contact us, Diamond Roof Tiling.', 'A', '{"1":[[0.2291666667,0.7083333333]],"2":[[0.2291666667,0.7083333333]],"3":[[0.2291666667,0.7083333333]],"4":[[0.2291666667,0.7083333333]],"5":[[0.2291666667,0.7083333333]],"6":[[0.2291666667,0.7083333333]],"0":[[0.2291666667,0.7083333333]]}', 'https://www.facebook.com/diamondrooftiling', 'https://twitter.com/DiamondRoofTile', '', '', '', '', 'https://plus.google.com/113956909416400235998/about'),
(45, 'startlocal-90493', 'StartLocal', '', 'StartLocal.com.au is an Australian local search engine that showcases over 1.2 million Australian businesses. ', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, '', '1300785706', '', '', '', 0, 0, 0, 0, 'http://www.startlocal.com.au/', 'StartLocal.com.au is an Australian local search engine that showcases over 1.2 million Australian businesses. With some highly innovative features that keep relevancy at the forefront of your search, StartLocal?? is the smart choice to find local businesses.\n\nUnlike other directories, paid listings do not affect our search results, so you get real local results every time. This means no more having to sift through pages of ads to find what you are looking for.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/startlocal/timeline', 'https://twitter.com/startlocal', '', '', '', '', ''),
(46, 'rd-homes-and-renovations-80980', 'RD Homes and Renovations', '', 'With RD Homes and Renovations, you don''t need to worry because our remarkable attention to detail and superior workmanship will translate to a home project you can be proud of.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'djovani@rdhomesandrenovations.com', '428449670', '', '', '262590885', 0, 0, 0, 0, 'http://www.rdhomesandrenovations.com.au', 'At RD Homes and Renovations, we believe that your project should be kept as simple and straightforward as possible, regardless how complex the task may seem. We focus on your precise wishes to deliver cost-effective solutions to any project. \n\nWe assist you throughout the building process and all it entails, and advise you on different possibilities, providing you with an appropriate and desirable solution. At RD Homes and Renovations, we have the skill, expertise and talent to exceed your expectations and look after the project from the start right through to completion. So, whatever your wishes may be, we can provide you with a fitting solution.\n\nHow many times did you, or someone you know, get a builder to do a job for you, but then had to have it redone properly by someone else, costing you precious time and money?\n\nThat will not happen with RD Homes and Renovations because quality workmanship and reliability is something we take great pride in. \nVery often, friends of our clients are so impressed that they build with us too!  So if you are thinking of building, renovating, extending or have a smaller project in mind, contact us for an obligation-free quote. You will not be disappointed. On the contrary, you will be recommending us to your friends because you too will be impressed!\n', 'A', '{"1":[[0.375,0.7083333]],"2":[[0.375,0.7083333]],"3":[[0.375,0.7083333]],"4":[[0.375,0.7083333]],"5":[[0.375,0.7083333]]}', '', '', '', '', '', '', ''),
(47, 'foreman-sheean-electrical-82644', 'Foreman-Sheean Electrical', '', 'Foreman-Sheean Electrical & Communications provides electrical services such as industrial, commercial, rural and domestic data and telecommunications within the Sunraysia Region.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'info@foreman-sheean.com.au', '350233902', '', '', '', 0, 0, 0, 0, 'http://www.foreman-sheean.com.au', 'ABOUT\n\nBeing located within Mildura, Foreman-Sheean quickly realised that in order for the company to grow and be able to service a wide range of industries, we would need to employee electricians with a wide range of skill sets and knowledge in all aspects of electrical and communications work. Due to size and experience, our Management and workforce of electricians have been given the opportunity to develop and refine the necessary skills within electrical and communications to enable us to provide and guarantee quality workmanship on large and complex electrical projects.\n\nForeman-Sheean Electrical & Communications is committed to further develop and consolidate our position as a large electrical contractor by providing, industrial, commercial, rural and domestic electrical services and data and telecommunications within the Sunraysia Region, as well as valuable community support. To assist us in this goal we are committed to our Quality Management System and on going training programs. Our internal focus is on improving an efficient, technically sound and quality orientated service to achieve greater customer satisfaction.\n\nTo ensure the continuous improvement of systems implemented and maintained by Foreman-Sheean Electrical Mildura, the partnership with our customers continues after the completion of any projects. We have a reputation for providing a prompt, efficient and reliable service, combined with a knowledgeable workforce of qualified electricians and the latest technology, we provide our customers with premium services and ensure all s