(49, 'starr-partners-90492', 'Starr Partners', '', 'Australia''s most innovative real estate brand.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'website@starrpartners.com.au', '288243133', '', '', '', 0, 0, 0, 0, 'http://www.starrpartners.com.au/', 'Established in 1992, Starr Partners have grown to become a highly respected network of successful offices, with a proven track record of delivering unrivalled results and exceeding client''s expectations. Starr Partners have always been a company that leads rather than follows and are constantly at the forefront of modern techniques and technologies, whilst maintaining traditional values and integrity.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/Starr-Partners-228375177176326/', 'https://twitter.com/starrpartners', '', '', '', '', ''),
(50, 'weststyle-interiors-80883', 'Weststyle Interiors', '', 'Here at Westyle Interiors, we can build you a brand new kitchen for both residential and commercial purposes.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'keith@weststyleinteriors.com.au', '409102547', '', '', '', 0, 0, 0, 0, 'http://www.weststyleinteriors.com.au', 'Providing Perth with quality residential kitchens and commercial interiors\nKitchen experts with a difference!\n\nWeststyle Interiors is a specialist for residential kitchens and commercial interiors in Malaga.\nOur team of dedicated professionals have the know-how to give you a stunning design that will improve the value of your property. \n\nCommercial Interiors:\n\nResidential and commercial kitchens in Malaga\nOur expertise for commercial interiors is unmatched by other businesses. We work with an aligned strategy involving design, craftsmanship and operational methods.\n\nCommercial interiors need to have a presence that reflects professional integrity.\n\nOur deep understanding of modern design means your commercial kitchen is guaranteed to have fantastic features. Cabinets, bench tops, the whole package.\n\nResidential Kitchens:\n\nResidential kitchen\nA residential kitchen is about personal taste and elegance. Your home is very important because it is where you spend most of your time. Having a kitchen that represents your taste and style is important to us because it is part of our commitment to making sure that quality is not undermined. With efficiency we can install or remodel a kitchen in a timely manner that does not impact your schedule and daily life. Our experts in Malaga are consultants as well, and we guide you through the process at each stage. \n\nQualified tradespeople:\n\nBuilder looking over future kitchen site\nOur qualified tradespeople in Malaga are the best of the best. We have an industry recognised team of experts with extensive experience in design, manufacturing and installation.\n\nOur combined skills mean a unique project every time for customers. We put emphasis on customer service as much as we do on top quality results.\n\nFor residential kitchens and commercial interiors in Malaga, give us a call today.', 'A', '{"1":[[0.375,0.7083333]],"2":[[0.375,0.7083333]],"3":[[0.375,0.7083333]],"4":[[0.375,0.7083333]],"5":[[0.375,0.7083333]]}', 'https://www.facebook.com/WeststyleInteriors?fref=ts', '', '', '', '', '', 'https://plus.google.com/101640639731410613029/about'),
(51, 'first-electrical-services-pty-ltd-82640', 'First Electrical Services Pty Ltd', '', 'First Electrical Services Pty Ltd have been servicing Melbourne since 1996. With over 25 years experience in the Electrical Contracting Industry, we pride ourselves in our expertise.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'colin@firstelectrical.com.au', '395000997', '', '', '', 0, 0, 0, 0, 'http://www.firstelectrical.com.au', 'About Us\n\nCommercial, Residential, Medical, Architectural\nOur main customer base of well established Builders, Developers, Commercial property owners and Managers have helped us direct our Company to servicing all facets of their Electrical needs. From Multi Residential Developments, Commercial Fit Outs, Industrial Units and the Single residential dwelling, we are equipped for all.\n\nPower, Light, Data, Fire, Design, Install\nWe have relationships with Australia?', 'A', '{"1":[[0.375,0.708333333]],"2":[[0.375,0.708333333]],"3":[[0.375,0.708333333]],"4":[[0.375,0.708333333]],"5":[[0.375,0.708333333]]}', '', '', '', '', '', '', 'https://plus.google.com/117582366310462520303/about'),
(52, 'furnware-dorset-90491', 'Furnware Dorset', '', 'We are unified in our dedication to optimise space and maximise living.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'info@furnwaredorset.com.au', '1300123700', '', '', '', 0, 0, 0, 0, 'http://www.furnwaredorset.com.au/', 'Furnware Dorset is an Australian-owned, family-run business serving the local kitchen, furniture and cabinetmaking industries. Our diverse and evolving range includes a large collection of cabinet handles, soft-close drawer systems, kitchen storage solutions, waste systems, sink ware, LED lighting and much more. Our range of innovative products are second to none when it comes to making the most of your living space and enhancing your everyday experience. \n\nWe''ve always believed in striving for outstanding customer support. By investing in our staff, we take care to ensure quality people back our quality products. \n\nWe are unified in our dedication to optimise space and maximise living.', 'A', '{"1":[[0.2916666667,0.7083333333]],"2":[[0.2916666667,0.7083333333]],"3":[[0.2916666667,0.7083333333]],"4":[[0.2916666667,0.7083333333]],"5":[[0.2916666667,0.7083333333]]}', 'https://www.facebook.com/FurnwareDorset', '', 'https://www.linkedin.com/company/furnware-trading', '', '', '', 'https://plus.google.com/116608648587683476928/about'),
(53, 'dapco-metal-roofing-79989', 'Dapco Metal Roofing', '', 'Dapco is a leading metal roofing supply and installation company that services all sectors of the building industry from commercial projects to residential homes and re-roofing.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, '', '755571500', '', '', '755022803', 0, 0, 0, 0, 'http://www.dapco.com.au', 'Developed on the Gold Coast 15 years ago, our success has been driven by quality workmanship and a strong commitment to customer service. These core values have resulted in the continuing success and consistent growth of Dapco to the thriving enterprise it is today.\n\nDapco Metal Roofing was established by Phillip Harrex at Nerang in 1995 to provide metal roofing supply and installation using traditional, hand crafted methods.\n\nThe business has been built up over the past 15 years and now services all sectors of the building industry from commercial projects to project homes, re-roofing, and owner builders working with the most complex designs.  Services include the supply and installation of all types of metal roofing, cladding  and ancillaries such as metal fascia, gutters, downpipes, Polycarbonate roofing and sheet metal fabrication.. \nDeveloped as an important addition to our business in 2006, our in-house sheet metal fabrication facility supports our efforts to provide a full service to our clients.  This facility also ensures consistency in material quality and turn-around times well beyond industry standards.\n\nThe foundation of our business is quality workmanship and a commitment to customer service and our own people.  These core values have resulted in the continuing success and consistent growth of our company to the thriving enterprise it is today.\n\nImportantly, we are not limited to installing conventional roofs. We have the flexibility and skills to work with any size of project, regardless of its complexity or design.\n\nWhether you select our most basic services or a comprehensive package, we have the systems and skilled professionals to ensure a quality, hassle free installation every time.', 'A', '{"1":[[0.291666,0.6875]],"2":[[0.291666,0.6875]],"3":[[0.291666,0.6875]],"4":[[0.291666,0.6875]],"5":[[0.291666,0.6875]]}', '', '', '', '', '', '', 'https://plus.google.com/102128938249322863883/about'),
(54, 'westshore-bathroom-renovators-80675', 'Westshore Bathroom Renovators', '', 'Westshore Bathroom Renovations are a leading Perth bathroom renovator and we understand that our clients want the renovation of their bathroom to be hassle free and seamless from start to finish.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'westshorebathrooms@gmail.com', '400173552', '', '', '', 0, 0, 0, 0, 'http://www.westshorebathrooms.com', 'We have been in the building industry for 14 years.    We have a weatlh of experience and want you, our client to be treated with professionalism and care.\n \nWe are a family owned and operated business.  You deal direct with the owner and not through sales people.\n \n Perths Professional Complete Bathroom Renovations & Makeover from Large Bathrooms to Small Bathrooms\n \nWestshore Bathroom Renovations are a leading Perth bathroom renovator and we understand that our clients want the renovation of their bathroom to be hassle free and seamless from start to finish.\n \nNo matter how large or how small your bathroom is the owner Craig of  Westshore Bathrooms will personally manage the\nbathroom renovation from the appointment to quote your bathroom -  to the full completion of your bathroom.\n \n \nBest Bathroom Renovation Team Perth - Westshore Bathroom Renovations Perth\n \nWestshore Bathroom Renovations Perth, WA do not employ the services of a salesperson with expensive commissions and incentives to provide and win quotes.  You will be dealing with the owner all the way - we keep your renovation personal.   Our key objective is to have quality trades who take the same pride in their work that we do. \n \nWe take care of all the details for you including:\n \n?', 'A', '{"1":[[0.2916666667,0.8333333333]],"2":[[0.2916666667,0.8333333333]],"3":[[0.2916666667,0.8333333333]],"4":[[0.2916666667,0.8333333333]],"5":[[0.2916666667,0.8333333333]],"6":[[0.2916666667,0.8333333333]]}', '', '', '', '', '', '', 'https://plus.google.com/110620848655558939779/about'),
(55, 'd-s-roofing-pty-ltd-79787', 'D S Roofing Pty Ltd', '', 'DS Roofing Brisbane, specialises in roof restorations, roof repairs, rebedding and pointing, whirly birds, roof cleaning, gutter cleaning, extensions and new roofs.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'info@dsroofing.com.au', '738069865', '', '433169600', '738000854', 0, 0, 0, 0, 'http://www.dsroofing.com.au', 'DS Roofing is a family owned and operated business we specialise in all things roofing. Whether it be tiled or metal we can help you out, Daniel also has years of experience in roof repairs. No job to big or small we can fix a leak or restore your roof. DS roofing is fully registered and licenced BSA, HIA, Master Builders, certificates in working at heights and a fully credited Dulux applicator. We are a no pressure sales company Daniel will come to you personally to quote your roof and be able to answer all your questions with his 15 years experience in roofing. Our staff are friendly and approachable with no request being to big or small.\n\nRoof Restorations\nIf your roof is looking tired and needs a face lift having a full roof restoration can update the look of your home.\n \nOur tradespeople perform a full inspection of the roof to detail the materials and repairs required.\n \nWe can assist you with you picking your new colour scheme.\n \nAs a result of our initial roof inspection all cracked or broken tiles are replaced.\n \nHigh pressure water blasting is required to remove moss, lichen and grime to achieve best results. No chemicals are used, only water.\n \nBefore painting all ridge caps, gables and hips are repointed. This completes the process of restoration of your roof prior to coating.\n \nAs part of the final step your roof is sterilised, sealed and membrane coated to your selected colour, providing a permanent finish that will withstand all weather conditions.\n\nRepairs and Rebedding\nOver time the bedding cement that holds ridge capping in place becomes brittle and needs to be replaced. This happens through exposure to the natural elements, small shifts in the housing structure, and the growth of plants, such as weeds and moss, within the small cracks of the bedding cement. When the bedding cement is dislodged gaps are exposed and water can enter the roof cavity. In addition the pieces of dislodged roof bedding cement can end up in the gutters and may cause blocked gutters and blocked downpipes. The process of rebedding and pointing the ridge capping is needed to ensure the roof is waterproof protecting the internal contents of the house from water damage.\n\nContact us for further details.', 'A', '{"1":[[0,1]],"2":[[0,1]],"3":[[0,1]],"4":[[0,1]],"5":[[0,1]],"6":[[0,1]],"0":[[0,1]]}', 'https://www.facebook.com/DS-Roofing-pty-ltd-133127380074186/', '', '', '', '', '', 'https://plus.google.com/117833848324935345856/about'),
(56, 'exlite-electrical-contractors-82636', 'Exlite Electrical Contractors', '', 'Electrical services for commercial installations, housing developments, electrical maintenance works, and assists with a variety of electrical needs for your home or business.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'accounts@exlite.com.au', '409234268', '', '', '', 0, 0, 0, 0, 'http://www.exlite.com.au', 'Delivering the right solution for your needs...\n\nExlite Electrical Contractors Pty Ltd is a Melbourne based business. Focused on providing its clients with the highest standards of both professionalism and customer service.\n\nNo project is too small, too large, or complex for us to successfully complete on time. We will deliver the right solution for your needs, within your budget and using the highest quality materials.\n\nExlite specialise in electrical services for commercial installations, dental practice electrical services, housing developments, electrical maintenance works, and assists with a variety of electrical needs for your home or business.\n\nWith the commitment of highly trained and motivated staff members, we are dedicated to providing attention to detail and understanding our customers?', 'A', '{"1":[[0.2916666667,0.75]],"2":[[0.2916666667,0.75]],"3":[[0.2916666667,0.75]],"4":[[0.2916666667,0.75]],"5":[[0.2916666667,0.75]],"6":[[0.2916666667,0.75]],"0":[[0.2916666667,0.75]]}', 'https://www.facebook.com/Exlite-Electrical-Contractors-207021212760766/', '', '', '', '', '', ''),
