(58, 'be-cool-air-conditioning-pty-ltd-81173', 'Be Cool Air Conditioning Pty Ltd', '', 'Be Cool Air Conditioning has been supplying, installing and repairing air conditioning units since 2000.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'sales@becoolairconditioning.com.au', '243698062', '', '', '', 0, 0, 0, 0, 'http://www.becoolairconditioning.com.au', 'We cover all areas of the Central Coast. As authorised dealers for Mitsubishi Electric, Panasonic, Actron Air, Daikin and Fujitsu, we can find the air conditioning unit to suit you and your needs. \n\nBe Cool is fully licensed and insured. We are also warranty service agents, so we are able to do any warranty work if the need ever arises.\n\n', 'A', '{"1":[[0.3333333333,0.7083333333]],"2":[[0.3333333333,0.7083333333]],"3":[[0.3333333333,0.7083333333]],"4":[[0.3333333333,0.7083333333]],"5":[[0.3333333333,0.7083333333]]}', '', '', '', '', '', '', ''),
(59, 'granny-flats-australia-90489', 'Granny Flats Australia', '', 'Welcome to a new era of architecturally designed and custom built granny flats in Sydney.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'wally@grannyflatsaustralia.com.au', '1300472669', '', '', '', 0, 0, 0, 0, 'http://grannyflatsaustralia.com.au/', 'We are a 1 stop shop for every aspect of your project, and will take care of the whole process in 3 easy steps.\n\nWith Granny Flats Australia, you will be able to take advantage of our detailed architectural design service, all our experienced consultants, and our in depth construction knowledge?', 'A', '{"1":[[0.375,0.7291666667]],"2":[[0.375,0.7291666667]],"3":[[0.375,0.7291666667]],"4":[[0.375,0.7291666667]],"5":[[0.375,0.7291666667]],"6":[[0.4166666667,0.6666666667]]}', 'https://www.facebook.com/Granny-Flats-Australia-207782015910600/', 'https://twitter.com/GrannyFlatsAust', '', '', '', '', 'https://plus.google.com/+GrannyflatapprovalsAu'),
(60, 'arrowform-pty-ltd-90488', 'Arrowform Pty Ltd', '', 'Arrowform specialise in the correct design of downlights and downlight covers in Australia.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, '', '246770799', '', '', '', 0, 0, 0, 0, 'http://www.arrowform.com.au/', 'Arrowform is an Australian downlight protection specialist offering efficient, friendly service along with a comprehensive range of downlight protection products. Our downlight protection products include: Isolite Downlight Guards, Flexi Downlight Covers, and Firebreak Fire Protection Downlights.\n \nArrowform was formed in 2003 specifically to address the many hidden and even life threatening consequences of exposed and unprotected recessed halogen downlights. After a family members house burnt down in WA from a downlight installation, it became apparent that something could be done to prevent this type of disaster from happening to others. After extensive R&D, the concept of Isolite was born, which has gone on to become an icon in downlight safety through out Australia and other nations.\n \nIn 2007, Flexi was released to market as an easy way to protect downlights that are installed in confined areas, such as Skillion roofs. A few months later, we released Firebreak, a very high quality downlight fitting protected integrally from risk of fire and also fire rated for 90 minutes to BS476.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
(61, 'clubs-australia-90487', 'Clubs Australia', '', 'Clubs Australia is the national, peak industry body representing the interests of Australia''s 6,000 licensed clubs.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'info@clubsaustralia.com.au', '1300730001', '', '', '', 0, 0, 0, 0, 'http://www.clubsaustralia.com.au/', 'Clubs Australia is the coalition of state and territory associations representing the interests of more than 6,500 licensed clubs across Australia and New Zealand.\n\nAs the peak industry body, Clubs Australia?', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', 'https://twitter.com/clubsaustralia', '', '', '', '', ''),
(62, 'd-a-metal-roofing-pty-ltd-79755', 'D & A Metal Roofing Pty Ltd', '', 'Welcome to D & A Metal Roofing Pty Ltd. We have built a reputation for dependable metal roofing services using COLORBOND?? steel which is strong, durable, energy efficient and built to last.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'darren@dametalroofing.com.au', '411516591', '', '', '', 0, 0, 0, 0, 'http://www.dametalroofing.com.au', 'Even though we are based in Brisbane and service the areas surrounding Brisbane we work closely with clients in Queensland and throughout Australia on domestic, commercial, and industrial properties and projects.\n\nWe give our customers the best possible choice by keeping up with the latest trends and innovations to enable our customers to comfortably make an informed choice in the areas of new installation, re-roofing, guttering and roof plumbing.\n\nD & A Metal Roofing Pty Ltd has been operating for 11 years under direction of Darren who has 19 years of experience and Amanda who has 11 years in the roofing and building industry.\n\nWe are happy to assist you with your material selection and answer any questions that you may have during the roofing process. We strive to give your roof the character, style and quality that your house deserves and that D & A is renowned for.\n\nOur tradesmen operate following industry health and safety regulations and specifications at all times. As a part of these expectations, we maintain a license under the Queensland Building Services Authority (QBSA Licence number: 1044754).\n\nWe offer a complete package from concept to completion.', 'A', '{"1":[[0.291666,0.6875]],"2":[[0.291666,0.6875]],"3":[[0.291666,0.6875]],"4":[[0.291666,0.6875]],"5":[[0.291666,0.6875]]}', '', '', '', '', '', '', ''),
