(64, 'summit-home-improvements-80936', 'Summit Home Improvements', '', 'Summit is one of Western Australia?', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, '', '863652901', '', '', '893301355', 0, 0, 0, 0, 'http://www.summithomeimprovements.com.au', 'Summit Home Improvements, as part of the Summit Homes Group, has helped thousands of homeowners reinvigorate their dream home. Because we?', 'A', '{"1":[[0.3541666667,0.7083333333]],"2":[[0.3541666667,0.7083333333]],"3":[[0.3541666667,0.7083333333]],"4":[[0.3541666667,0.7083333333]],"5":[[0.3541666667,0.7083333333]],"6":[[0.375,0.5416666667]]}', 'https://www.facebook.com/SummitHomeImprovements', '', '', '', '', '', 'https://plus.google.com/+SummithomeimprovementsAustralia/about');
