(65, 'csf-commercial-industrial-roofing-79722', 'CSF Commercial & Industrial Roofing', '', 'Supply and installation of roofing and wall cladding to commercial, industrial, government and private buildings. This includes Roof and Cladding Installation, Re-roofing services and many more.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'tenders@csfsteel.com.au', '740351506', '', '', '740351894', 0, 0, 0, 0, 'http://www.csfsteel.com.au', 'CSF STEEL FABRICATORS\n\nCairns Steel Fabricators Pty Ltd is a locally owned business, established since 1979 and currently employing approximately 140 personnel. This includes boilermakers, fitters, certified welders, riggers, dogmen, crane operators, draftspersons and administration staff. \n\nOperating from our 8600m2 modern facility situated on 17000m2 of land within the Cairns Port Industrial area, we have access to all types of transport requirements (e.g. road, rail, air & sea). Combined with our own fully equipped workshop, trucks and cranes, we are able to handle all types of work and fabricate approximately 80-120 tonnes of large steel per week.\n\nCSF operates a state of the art blast & painting facility which can handle objects 24m long x 5m high x 6m wide. We have experience in marine, industrial, commercial and architectural painting applications.\n\nCSF also operates it''s own detailing office. Currently we have 6 full time detailers all usingTekla and StruCAD 3D software. CSF details the majority of projects in house.\n\nCSF also operates a Townsville office supporting project works being undertaken in the Townsville, western and southern areas of Queensland including Mackay, Rockhampton, Gladstone and others.', 'A', '{"1":[[0.291666,0.6875]],"2":[[0.291666,0.6875]],"3":[[0.291666,0.6875]],"4":[[0.291666,0.6875]],"5":[[0.291666,0.6875]]}', '', '', '', '', '', '', ''),
(66, 'industrial-hy-tech-garage-doors-72406', 'Industrial Hy-Tech Garage Doors', '', 'Industrial Hy-tech is a specialist garage door business that sells, installs and services roller doors, sectional overhead doors, tilt doors and garage door operators in Geelong and surrounding areas.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, '', '352722346', '', '', '', 0, 0, 0, 0, 'http://www.industrialhy-techgaragedoors.com.au/', 'Industrial Hy-tech was established in 1990 in Geelong. It was acquired by the Steel-Line group in 2007 and now represents the Steel-Line, Mirage and BOSS product ranges in Geelong. The major products of Industrial Hy-tech include garage and shed roller doors, penal lift doors, tilt garage doors, industrial roller shutters, roller grilles, counterweight doors, folding closures and many other shopfront doors.\n\n\nSECTIONAL DOORS\n\nMake a bold impression with a stunning Steel-Line sectional garage door. We have a range of garage door styles to suit the unique characteristics of your home. Choose from the stylish Heritage, Ranch, Slim-line, Flat-line or Glacier door style, and then select the colour of your choice to really dress up and enhance the exterior of your home. Don''t forget to ask us about the latest garage door trends - DecoWood range, DecoVogue range and Inspirations range.\n\n\nROLLER DOORS\n\nOur Steel-Line roller doors are easy to use and long lasting. They can be made to suit almost any size garage or shed opening. Combine this with a range of Colorbond colours and smooth operation making them some of the strongest, quietest and most reliable door available.\n\n\nCOMMERCIAL & INDUSTRIAL\n\nMirage''s Industrial Shutters and Shopfront Doors combine unique designs with strength and reliability - nothing else compares! We have continued to design and develop product solutions for an ever - increasing diversity of applications such as shopfronts, showrooms, counters, window protection, car park entries, warehouses, aircraft hangars, indoor / outdoor separation, etc.\n\n\nAUTOMATION\n\nDid you know that our BOSS garage door openers can be fitted to most popular brands of garage doors and industrial / commercial doors, and accessoried to suit your requirements? Some of the main advantages of Boss openers include stylish design, quiet operation and in-built safety timer.\n\n\n\n', 'A', '{"1":[[0.375,0.70833333]],"2":[[0.375,0.70833333]],"3":[[0.375,0.70833333]],"4":[[0.375,0.70833333]],"5":[[0.375,0.70833333]]}', '', '', '', '', '', '', 'https://plus.google.com/107305299675172822100/about'),
(67, 'baramenco-pty-ltd-81164', 'Baramenco Pty Ltd', '', 'Air Conditioning Sydney homes for more than 30 years', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, '', '294765955', '', '', '294777779', 0, 0, 0, 0, 'http://www.baramenco.com.au', 'Baramenco''s name is synonymous with air conditioning and central heating on Sydney''s North Shore. Hornsby has been our base for more than thirty years and from here we travel north to the Hawkesbury, east to the beaches, south to Mosman and Kirribilli, and west to Pennant Hills.\n\nWe provide high quality advice, design, supply and installation, and maintenance of premium quality air conditioning, central heating and ventilation equipment.\n\nBaramenco provides a showroom display of representative split system air conditioners together with ducted and central heating fittings and grilles.\nIf you are serious about product quality and a professional installation, please contact us for a survey or bring your plans to our showroom, where you can see, feel and hear the Baramenco difference.', 'A', '{"1":[[0.2916666,0.6666666]],"2":[[0.2916666,0.6666666]],"3":[[0.2916666,0.6666666]],"4":[[0.2916666,0.6666666]],"5":[[0.2916666,0.6666666]]}', '', '', '', '', '', '', ''),
(68, 'smart-renovator-81003', 'Smart Renovator', '', 'The essential online resource for Australian renovators looking to do things smarter and easier.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'denise@smartrenovator.com.au', '419542805', '', '', '', 0, 0, 0, 0, 'http://www.smartrenovator.com.au', 'Smart Renovator is the essential online resource for Australian renovators looking to do things smarter and easier. We help save you time, money and stress by providing essential information, step by step guides, services and ready to use tools and templates to assist with planning, managing and completing your home renovation.\n\n Smart Renovator is also an online resource for granny flats - helping buyers make an informed and smart decision.', 'A', '{"1":[[0.375,0.7083333]],"2":[[0.375,0.7083333]],"3":[[0.375,0.7083333]],"4":[[0.375,0.7083333]],"5":[[0.375,0.7083333]]}', '', '', '', '', '', 'https://www.pinterest.com/smartrenovator/', 'https://plus.google.com/100214834095333604153/posts'),
