(76, 'revive-renovation-specialists-80725', 'Revive Renovation Specialists', '', 'Revive?', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'paul@revive-projects.com', '893154244', '', '412908543', '', 0, 0, 0, 0, 'http://www.revive-projects.com', 'Renovations are a specialty at Revive Renovation Specialists. We understand how carefully you have come to the decision to renovate your home, and how best to provide a great service with minimum disruption.\n\nOur 17 years of experience in the renovations industry gives us the knowledge to help turn your vision into reality.\n\nRevive Renovation Specialists have a long time recruited and experienced team that can provide for every aspect of the project delivery, from the initial design and presentation images through to construction and many years beyond.\n\nWe work with you to improve the comfort and value of your home.\n\nRevive Renovation Specialists bring an extensive experience of the council submission system to your extension or addition project. We understand how the Residential Codes relate to your site and how best to maximise the opportunities of development.\n\nOur emphasis on design allows us to offer a clearly articulated vision of your development, and our experience in construction ensures a smooth path through the construction process. Revive are able to give a detailed and reliable account works involved and assemble an experienced team of tradespeople to complete your extension on time and on budget.\n\nOUR SERVICES:\n\n?', 'A', '{"1":[[0.375,0.7083333]],"2":[[0.375,0.7083333]],"3":[[0.375,0.7083333]],"4":[[0.375,0.7083333]],"5":[[0.375,0.7083333]]}', 'https://www.facebook.com/Revive-Renovation-Specialists-277857502306602/', '', '', '', '', '', 'https://plus.google.com/+Reviveprojectsandrenovations/about'),
(77, 'mbr-roofing-79660', 'mbr roofing', '', 'MBR Roofing has roofed, re-roofed and plumbed residential, commercial and industrial properties in Victoria for 20 years.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'michael@mbrroofing.com.au', '433277055', '450807017', '410209070', '', 0, 0, 0, 0, 'http://rciroofing.com.au', 'We provide roof guttering and plumbing, asbestos removal, wall cladding, skylight installation, industrial maintenance and fire damage repair. We only use the highest-quality materials including Colorbond, Zincalume and Bluescope\n\nMBR Roofing brings to you 20 years experience in the roofing industry. We provide roofing services to residential, commercial and industrial properties. Using high-quality Colorbond, Zincalume and Bluescope materials, we build metal roofs that you can rely on, providing a full service including roof plumbing, gutters and downpipes, as well as installing skylights.\n\nWhether you require a new roof or want an old roof restored, we can meet your needs in a professional and timely manner. Our quotes are fair and our Work Method Statements comprehensive so you know exactly what you?', 'A', '{"1":[[0.291666,0.6875]],"2":[[0.291666,0.6875]],"3":[[0.291666,0.6875]],"4":[[0.291666,0.6875]],"5":[[0.291666,0.6875]]}', 'https://www.facebook.com/MBR-Roofing-230810520421417/', '', '', '', '', '', ''),
(78, 'phoenix-bathroom-renovations-80609', 'Phoenix Bathroom Renovations', '', 'We are a team of enthusiastic, goal driven professionals who strive to deliver exceptional bathroom renovations catered to personal taste and unique styles.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'caesar@phoenixbr.com.au', '893021782', '', '419919850', '', 0, 0, 0, 0, 'http://www.phoenixbr.com.au', 'We are a family owned business with a big heart and a big family membership. We have grown up with certain values that ground us and define who we are; the values of honor, honesty and hard work are central to our family philosophy. With industry experience over thirty years in both Europe and Australia, Caesar founded Phoenix Bathroom Renovations with a vision fuelled by his creative passions in ceramic art and years of experience in business and enterprise.\n\nAsk around in Perth and you will hear about Caesar?', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/phoenixbr.com.au', '', '', '', '', '', ''),
(79, 'mcl-roofing-79982', 'MCL Roofing', '', 'At MCL Roofing, we pay close attention to details and we believe in doing the job right the first time. We also work in accordance with all the current safety regulations and requirements.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'info@mclroofing.com.au', '417579775', '', '', '', 0, 0, 0, 0, 'http://www.mclroofing.com.au', 'Established 17 years ago, MCL Roofing is an owner-operated and fully licensed company which specialises in a number of roofing services. We provide a comprehensive roofing installation, offering an extensive range of services to our customers from Melbourne to the Mornington Peninsula.\n\nHaving completed a vast ammount of roofing installations over the years, we have acquired extensive knowledge and experience in the field. Whether you need roofing services for your residential or commercial set-up, you can trust us to deliver products and services of the highest standards.\n\nOur friendly and professional staff uses latest technologies and materials like Australian Bluescope Colourbond Steel and suppliers like Apex to provide the most reliable as well as the best quality roofing solutions to customers.\n\nWhen you call upon our assistance you can count on the highest quality work being carried out by true roofing professionals with a wealth of experience. We''re so confident of the quality of the services we provide that all work and materials are guaranteed. We want to give you peace of mind that your home and property is protected for years to come.\n\nDon''t hesitate to contact us for all your metal roofing needs, we have the best solutions for you.', 'A', '{"1":[[0.291666,0.6875]],"2":[[0.291666,0.6875]],"3":[[0.291666,0.6875]],"4":[[0.291666,0.6875]],"5":[[0.291666,0.6875]]}', 'https://www.facebook.com/MCL-Roofing-863972526996924/', '', '', '', '', '', ''),
(80, 'melbourne-quality-roofing-79632', 'Melbourne Quality Roofing', '', 'We provide a wide range of roof repairs and services to protect your building or home, including roof leak repair and tile roof repairs.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, '', '466885133', '', '', '', 0, 0, 0, 0, 'http://www.melbournequalityroofing.com.au', 'Melbourne Quality Roofing can save save you thousands. A leaky roof can create untold havoc within your home; electrics, timber, plaster, flooring can all be subject to water damage. Contact Melbourne Quality Roofing and we can identify and fix the problem before it leads to others. We?', 'A', '{"1":[[0.3333333333,0.8333333333]],"2":[[0.3333333333,0.8333333333]],"3":[[0.3333333333,0.8333333333]],"4":[[0.3333333333,0.8333333333]],"5":[[0.3333333333,0.8333333333]],"6":[[0.375,0.6666666667]]}', 'https://www.facebook.com/Melbourne-Quality-Roofing-1601654120084185/', '', '', '', '', '', 'https://plus.google.com/+MelbourneQualityRoofingClaytonSouth/about'),
(81, 'perth-extensions-80911', 'Perth Extensions', '', 'Perth Extensions specialises in home and office extensions and additions. We are a mobile business and offer free consultation and quote.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'info@perthextensions.net.au', '894349501', '', '', '', 0, 0, 0, 0, 'http://www.perthextensions.net.au', 'Perth Extensions are registered builders who specialize in home extensions, renovations and granny flats with teams working North and South of the river.\n \nOur team consists of construction professionals with over 20 years experience. The team is made up of individuals that excel in their field, take pride in their work and understand the demands of the home extension and renovation market.\n \nWe have built a reputation for our high quality workmanship and customer focused service. The majority of our work is generated from word of mouth and referrals. \n \nPerth Extensions Pty Ltd has been recognized for giving back to the community by the Lions International, Minister of Workforce Training and Development and Medicins Sans Frontieres.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/perthextensions?fref=ts', '', '', '', '', '', 'https://plus.google.com/109681325706144008622/about'),
(82, 'modern-home-improvers-80997', 'Modern Home Improvers', '', 'Catering for both single and double storey home extensions for over 30 years we can transform your house with a complete or partial makeover to suit your budget.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, '', '892441993', '', '', '', 0, 0, 0, 0, 'http://www.modernhomeimprovers.com.au', 'With over 35 years experience, Modern Home Improvers has grown to be one of the leading home extension and improvements specialists in Perth, Western Australia.\n\nHouse extensions and renovations can often be a painful task, but at Modern Home Improvers, our dedicated team of professionals will ensure your dream single or double storey home additions become a reality with minimal hassle.\n\nBoasting many Master Builders Association (MBA) and Housing Industry Association (HIA) awards and award nominations, we can provide the home extensions and renovations you need at a price you can afford.\n\nModern Home Improvers commenced back in 1976 with the company building patios and brick enclosures. As we progressed through the 1980''s the company started to move into double brick and tile additions, specialising in second storey additions, renovating bathrooms and kitchens.\n\nOne of the major breakthroughs in technology came in 1991 when we acquired a computer package that gave our clients a real insight with 3D walkthroughs of the proposed extensions to the home. This has proven to be a valuable piece of software that has put Modern Home Improvers at the forefront of today''s designing technology.\n\nModern Home Improvers is a family owned business with managing director Bruce Sertorio and wife Anne Sertorio overseeing the day to day running of the business.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', 'https://www.facebook.com/modernhomeimprovers', '', '', '', '', '', 'https://plus.google.com/110612443358979453043/about'),
(83, 'millband-bathroom-renovations-perth-80607', 'Millband Bathroom Renovations Perth', '', 'Millband Bathroom Renovations provide a complete bathroom and laundry renovation service.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'claire@millband.com.au', '424127300', '', '', '', 0, 0, 0, 0, 'http://www.millband.com.au', 'Established in 1988 we have over 26 years experience in all aspects of Bathroom & Laundry renovation. You will receive a highly professional and personable service from the initial consultation right through to completion, including those all important finer finishing details. \n\nAt Millband Bathroom Renovations we not only pride ourselves in our workmanship, but also in ensuring minimal disruption to your household whilst work is in progress. We are competitive and offer installations suiting all budgets without compromising the standard of work.', 'A', '{"1":[[0,1]],"2":[[0,1]],"3":[[0,1]],"4":[[0,1]],"5":[[0,1]],"6":[[0,1]],"0":[[0,1]]}', 'https://www.facebook.com/MillbandBathroomRenovations', '', '', '', '', '', 'https://plus.google.com/106055545515777761467/about'),
