(85, 'grace-removals-cairns-90485', 'Grace Removals Cairns', '', 'ACROSS THE STREET, ACROSS THE WORLD. THE BEST MOVES ARE MADE WITH GRACE.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, '', '740351799', '', '', '740351551', 0, 0, 0, 0, 'http://www.grace.com.au/', 'Let Grace Removals take away the stress that comes with moving, as our expert team is here to cater to all of your needs. We will arrange everything for you, from uplift to delivery and everything in between. Our team will create a personalised relocation plan for you that can include insurance, packing supplies, pet relocation and any other special requirements. At Grace we pride ourselves on our customer service, giving customers peace of mind that everything will go according to plan within their time frame.', 'A', '', 'http://www.facebook.com//pages/Grace-Removals-Group/388701484531136', '', 'http://www.linkedin.com/company/grace-removals-group', '', '', '', 'http://plus.google.com/102843680809712764468'),
(86, 'greater-northern-removals-townsville-90484', 'Greater Northern Removals Townsville', '', 'At Greater Northern Removals & Storage, we know that your possessions are more than just furniture and boxes, they are precious memories, and the heart of your home.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, '', '434046938', '', '', '', 0, 0, 0, 0, 'http://www.gnremovals.com.au/', 'At Greater Northern Removals & Storage, we know that your possessions are more than just furniture and boxes, they are precious memories, and the heart of your home.\n\nOur 25 years experience has taught us that moving can be a highly stressful time.\n\nTo reduce this stress, we have developed a personalised service that will guide and assist you in every step of the moving process, including packing, removal and storage of all your household items.\n\nWe are able to offer all the services of the larger national brands while retaining the personalised service that we know you want.', 'A', '', '', '', '', '', '', '', ''),
(87, 'wridgways-cairns-90483', 'Wridgways Cairns', '', 'Five star service, from start to finish', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, '', '740455933', '', '', '740454897', 0, 0, 0, 0, 'http://www.wridgways.com.au/', 'Make your next move a great experience with Santa Fe Wridgways and our team of dedicated moving experts who are passionate about providing five star service. We consistently strive to exceed expectations and genuinely care about you and your move.\n\nAs part of the global Santa Fe Group we have 125 offices worldwide and over 120 years of experience which means we have the expertise and the resources to offer you the very best in premium moving and relocation services.\n\nWhether you are moving in Australia, or across the globe, we make it easy at Santa Fe Wridgways.', 'A', '', 'http://www.facebook.com/Wridgways', 'http://twitter.com/sfwridgways', '', '', '', '', 'https://plus.google.com/116580481942203901950'),
(88, 'allied-pickfords-townsville-90482', 'Allied Pickfords Townsville', '', 'Allied Pickfords has been picking things up and putting them somewhere else for almost 400 years.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, '', '747745799', '', '', '747745925', 0, 0, 0, 0, 'http://www.alliedpickfords.com.au/', 'The World?', 'A', '', '', '', '', '', '', '', ''),
(89, 'real-estate-education-and-training-nsw-90481', 'Real Estate Education and Training NSW', '', 'Real Estate Training offers all the courses you require to advance in the Real Estate Industry. ', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'kathy@thesalesmasters.com', '297009333', '', '', '', 0, 0, 0, 0, 'http://www.realestatetrainingnsw.com.au/', 'Real Estate Training offers all the courses you require to advance in the Real Estate Industry. We are dedicated to improving and upskilling your best resource...you/ your people.\n\nAll of our Real Estate training courses are available in a variety of delivery styles.\n\nFace to face training... Our schedule of dates is on the website with locations etc. We are happy to come to your office and conduct inhouse if preferred (conditions apply).\n\nDistance learning... This learning style allows you to study at your own pace and fit most easily with your life style. Start today...finish at your own pace. Mentors available to support you.\n\nE learning... This learning style is hugely popular because it is extremely flexible and self paced. The message is consistent and able to be updated easily and instantly.\n\nWhether you are a New Team Member in a Real Estate office or an Experienced Agent, Real Estate Training1 will deliver on its promise of the best products for the best prices.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', ''),
(90, 'centrapak-industries-90480', 'Centrapak Industries', '', 'We manufacture and distribute a broad range of packaging products to clients in Wagga Wagga, Riverina and Australia wide.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'sales@southlandgroup.co', '269239600', '', '', '', 0, 0, 0, 0, 'http://www.centrapak.com.au/', 'We manufacture and distribute a broad range of packaging products to clients in Wagga Wagga, Riverina and Australia wide.\n\nOur clients depend on a fast, personalised service and ability to address any packaging problem and recommend products to suit your needs.\n\nOur recommendations of appropriate packaging products are governed by three key principles:\n\n?? Improved Efficiency\n\n?? Reduced Waste\n\n?? Maximising YOUR profitability\n\nHistory:\n\nCentrapak was founded in 1976, and focused on supplying the retail sector to Wagga Wagga and Riverina area.\n\nIn 2005, the business was restructured to better concentrate on the needs of industry.\n\nToday, we bring knowledge, experience, and commitment to servicing your complete warehouse, packaging & retail display requirements.', 'A', '{"1":[[0.3125,0.7083333333]],"2":[[0.3125,0.7083333333]],"3":[[0.3125,0.7083333333]],"4":[[0.3125,0.7083333333]],"5":[[0.3125,0.7083333333]]}', '', '', '', '', '', '', 'https://plus.google.com/101574598492388140328/about'),
(91, 'ballina-air-conditioning-refrigeration-81163', 'Ballina Air-Conditioning & Refrigeration', '', 'We are dedicated to personal service and excellence in every aspect of our business. We provide Ballina with reliable and quick service throughout the year.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'rebtec@bigpond.com', '414931864', '', '', '', 0, 0, 0, 0, 'http://www.ballinaaircon.com.au', 'Our expert air conditioning technicians are qualified and experienced. They will give you the best advice on how and where to install your home air conditioning system and carry out their work to the highest standards. \n\nBallina Air Conditioning & Refrigeration only supply top quality, reliable brands and products designed to withstand local weather conditions. We will also advise you on the most environmentally and cost effective options for you.\n\n\n\nWe provide complete home air conditioning services, skilled technicians and excellent customer service:\n\n?', 'A', '{"1":[[0.2916666,0.6666666]],"2":[[0.2916666,0.6666666]],"3":[[0.2916666,0.6666666]],"4":[[0.2916666,0.6666666]],"5":[[0.2916666,0.6666666]]}', 'https://www.facebook.com/HayAirConditioningRefrigerationPtyLtd', '', '', '', '', '', ''),
(92, 'standard-computers-australia-88876', 'Standard Computers Australia', '', 'Established in 1988, Standard Computers Australia (SCA) is a leading provider of information technology products Australia Wide.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'sales@standard.com.au', '393151234', '', '', '', 0, 0, 0, 0, 'http://www.standard.com.au', 'Established in 1988, Standard Computers Australia (SCA) has become a leading local provider of information technology and office automation equipment. Based on the policy of complete service at reasonable pricing SCA is a reliable and service orientated source for all of your office automation requirements.\n\nThe company is situated 10 minutes from the CBD adjacent to the Westgate Freeway and since 1988 has grown to the present staffing level of 20 with an expansive showroom of 4000 sq feet. High stock levels are held to provide a one stop shop for all our clients, custom displays exhibit up to ten working computers at any one time available for a working demonstration. Staff training is conducted on a regular basis to ensure customer confidence and competent assistance.\n\nConsistent service to our clients has been recognised by Tier One Suppliers awarding key dealerships to SCA. Direct access of all Tier One suppliers include:\n\n-Computer Systems - SCA, Compaq, IBM, Hewlett Packard, Toshiba, Acer, Asus,\n-Networking Systems - Intel, Novell, Cisco, Netgear, Dlink, Netcomm, TP-Link,\n-OEM Partners - Intel, Microsoft, IBM, Mitsubishi, Samsung\n-Printer Service Agents - Canon, Brother\n\nAt SCA we not only pride ourselves in being a reliable supplier of quality office automation products, but more importantly providing unbias professional advice and consultancy on the right solution for your requirement. SCA possess the right people (Microsoft Certified) with the right knowledge base to provide the right answers to your IT questions. At SCA our engineers can also assist your company in the areas of Network Design, Migration Services, Internet Access, Auditing Services, and Software Training.\n', 'A', '{"1":[[0.375,0.7291666667]],"2":[[0.375,0.7291666667]],"3":[[0.375,0.7291666667]],"4":[[0.375,0.7291666667]],"5":[[0.375,0.8333333333]],"6":[[0.3958333333,0.6041666667]]}', 'https://www.facebook.com/StandardComputers?ref=ts&fref=ts', 'https://twitter.com/SCA_1988', '', '', '', '', 'https://plus.google.com/109488227088287644540/about'),
(93, 'white-international-pty-ltd-90479', 'White International Pty Ltd', '', 'White International is an importer and distributor of quality products throughout the Australasian Tool and Pump markets. ', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, '', '1300783601', '', '', '', 0, 0, 0, 0, 'https://www.whiteint.com.au/', 'White International is an importer and distributor of quality products throughout the Australasian Tool and Pump markets. With over 63 years of experience, White International has become a company known for its extensive product range and dedicated customer service.\n\nImporting over 20,000 unique products and distributing to a network of over 4,000 stockists throughout Australia and New Zealand, White International has secured its position as a key player in the industrial tool and pump industries through our network of suppliers.\n\nWhite International is able to source innovative products from across the globe and hold exclusive distribution rights in Australia for a number of brands, whilst developing their own brands.\n\nWhite International is a B2B focused company, suppling to businesses from large retail chain stores to your local family owned plumbing store. A company built on strong family values, White International understands the keys to retaining our loyal customer base is excellent service and reliable product.', 'A', '{"1":[[0.3541666667,0.7083333333]],"2":[[0.3541666667,0.7083333333]],"3":[[0.3541666667,0.7083333333]],"4":[[0.3541666667,0.7083333333]],"5":[[0.3541666667,0.7083333333]]}', '', '', '', '', '', '', 'https://plus.google.com/112580991881969325352/about'),
(94, 'austin-air-conditioning-81158', 'Austin Air Conditioning', '', 'From sales to installation and servicing, we are your one-stop-shop for all your air conditioning needs.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'sales@austinac.com.au', '264922801', '', '', '', 0, 0, 0, 0, 'http://www.austinac.com.au', 'Specialising in Daikin split and ducted systems, we have a wide variety of additional brands and models for sale including reverse cycle split systems and fully ducted systems.\n\nAs well as being local air conditioning installation experts, we also offer many additional products and services. We can provide a full electrical and refrigeration service for your farm requirements. This include vat refrigeration and servicing, motor control including variable speed control of milking plants and generator installations for power outage protection. We can also help with feed controllers and roller mills....\n\nOur team consists of licensed electrical, refrigeration and air conditioning contractors who are dedicated to providing excellent workmanship and a friendly service. We tailor our service to suit your individual needs and will ensure communication is always clear between us. So for a reliable air conditioning installation team in South East NSW, call us.', 'A', '{"1":[[0.2916666,0.6666666]],"2":[[0.2916666,0.6666666]],"3":[[0.2916666,0.6666666]],"4":[[0.2916666,0.6666666]],"5":[[0.2916666,0.6666666]]}', '', '', '', '', '', '', ''),
(95, 'epping-electrical-82633', 'Epping Electrical', '', 'We provide Electrical Services in Domestic, Commercial and Industrial areas, we also provide Data and Telephone Services. ', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'geoff@eppingelectrical.com', '431232796', '', '', '', 0, 0, 0, 0, 'http://www.eppingelectrical.com', 'Our Story\n\nEpping Electrical is the leading Electrical Contracting business operating in the Northern Suburbs of Melbourne Victoria.  We have been trading as Epping Electrical since 2009 and has become a well known and trusted operation. \n\nWe provide Electrical Services in Domestic, Commercial and Industrial areas, we also provide Data and Telephone Services.  For many of our domestic customers, additional power points, light fittings and Switchboard upgrades is undertaken most frequently.  We do work for a select number of quality builders on architect designed projects, our attention to detail and reliability is what keeps these builders calling us back every time.\n\nSERVICES\n\nOur electricians are licensed, registered and insured. We provide the following services:\n\n* Underground Power\n\n* Powerline Replacements\n\n* Powerpoints and lighting\n\n* TV point installation\n\n* New homes\n\n* Home Rewiring\n\n* Heaters\n\n* LED lighting\n\n* Exhaust fans\n\n* Ovens\n\nOur business is based in Epping Victoria, we understand that travel is part of the service business that we are in.  For general Electrical work, we do often travel up to an hour away from Epping to service our customers. \n\nThe Powerline Replacement Program and Underground Power work are the exceptions.  As this work is our speciality, we are prepared to undertake work anywhere in Victoria.  Statewide Underground Power is our new brand for this work.', 'A', '{"1":[[0.2916666667,0.7916666667]],"2":[[0.2916666667,0.7916666667]],"3":[[0.2916666667,0.7916666667]],"4":[[0.2916666667,0.7916666667]],"5":[[0.2916666667,0.7916666667]]}', 'https://www.facebook.com/EppingElectrical', '', 'https://www.linkedin.com/company/epping-electrical', '', '', '', 'https://plus.google.com/+Eppingelectricalvic/about'),
(96, 'austech-airconditioning-services-pty-ltd-81157', 'Austech Airconditioning Services Pty Ltd', '', 'At Austech Air conditioning we endeavor to provide quality products and services in order to satisfy our customer?', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'service@austechairconditioning.com.au', '1300135637', '', '414566620', '246483094', 0, 0, 0, 0, 'http://www.austechairconditioning.com.au', 'With over 20 years experience in the air conditioning and refrigeration industry, you can be sure to get expert advice for the cooling and heating of your home or business, that meets your needs and most importantly your budget.\n\n\nWe offer to domestic and commercial customers:\n\n?', 'A', '{"1":[[0.2916666,0.6666666]],"2":[[0.2916666,0.6666666]],"3":[[0.2916666,0.6666666]],"4":[[0.2916666,0.6666666]],"5":[[0.2916666,0.6666666]]}', 'https://www.facebook.com/austech.com.au', '', '', '', '', '', ''),
(97, 'spade-computers-office-machines-88875', 'Spade Computers & Office Machines', '', 'SPADE COMPUTERS has been supplying and servicing software, computers and copiers  throughout the Goulburn Valley region since 1981.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'spade@spadecomp.com.au', '358217011', '', '', '', 0, 0, 0, 0, 'http://www.spadecomp.com.au', 'Our Computer Sales Department offers the latest in desktop and notebook computers, printers and accessories, catering for small business, home office and students, right through to network systems. Our brands include Acer, Leading Edge Computers, Toshiba, Hewlett Packard and our own brand computer. You can choose from our catalogue systems, computer package specials or we can design a system to suit your specific needs. Our sales staff are happy to offer their advice in planning your system requirements.\n \nIn March of 2003 we added Copiers and Printers to our range with the purchase of Rod Kilgour Office Machines. With the convergence of technologies with imaging, printing, copying and scanning and our network expertise, we can now offer the total solution for your office environment.\n \nWe carry an extensive range of Stationery & Consumables including ink cartridges, laser toner cartridges, paper, specialty printing paper, disks, tapes, cables and a whole lot more.\n \nThe Technical Department offers preventative maintenance and repairs for all your office products. Our Service Technicians are fully trained and we are service agents for some for most of the products we sell.\n \nSo for all your office needs, contact us.', 'A', '{"1":[[0.3541666667,0.7291666667]],"2":[[0.3541666667,0.7291666667]],"3":[[0.3541666667,0.7291666667]],"4":[[0.3541666667,0.7291666667]],"5":[[0.3541666667,0.7291666667]]}', 'https://www.facebook.com/Spade-Computers-Office-Machines-138462889554787/', '', '', '', '', '', ''),
(98, 'australian-joinery-products-90478', 'Australian Joinery Products', '', 'Welcome to Australian Joinery Products Pty Ltd', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, '', '755633183', '', '', '', 0, 0, 0, 0, 'http://www.australianjoinery.com/', 'Australian Joinery Products Pty Ltd is a family owned and operated business, committed to quality products and services. Our experienced tradesmen use advanced machinery technology so that Australian Joinery Products Pty Ltd can offer a wide range of customized and architecturally designed products in a multitude of materials and finishes manufactured locally.\n\nWhen you think of a joiner you may think cabinet making and kitchen manufacturing. This is only part of the service that Australian Joinery Products Pty Ltd can provide to our clients.\n\nThe team is managed by Jim Parsell, a tradesman with more than 40 years experience in the cabinet and joinery industry. Australian Joinery Products Pty Ltd is a member of Housing Industry of Australia #883376 as well as being licensed by the Queensland Building Services Authority #1257983; we are proud that our products are locally manufactured using locally produced raw materials where available.', 'A', '{"1":[[0.375,0.7083333333]],"2":[[0.375,0.7083333333]],"3":[[0.375,0.7083333333]],"4":[[0.375,0.7083333333]],"5":[[0.375,0.7083333333]]}', '', '', '', '', '', '', 'https://plus.google.com/101114983390455570626/about'),
(99, 'elthurst-electrics-82630', 'Elthurst Electrics', '', 'Elthurst Electrics has been established for 30 years and currently employs 13 trades persons and 4 apprentices. We offer a full electrical fit out including data and Telstra as applicable.', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'sharon@elthurst.com.au', '394659844', '', '', '', 0, 0, 0, 0, 'http://www.elthurst.com.au/index.html', 'WELCOME TO ELTHURST ELECTRICS\n\nElthurst Electrics has been established for 30 years and currently employs 13 trades persons and 4 apprentices.\n\nWe offer a full electrical fit out including data and Telstra as applicable.\n\nA large percentage of our work consists of small to medium commercial and building sites as well as office tenancy and shop fitouts. We also are involved with various building projects ranging from $5,000.00 to $1,000,000.00.\n\nABOUT US\n\nCurrent Projects\n\n* Our Lady of Sion College, Contract Value $400,000 Builder J.C. Rawlings,\n* Huntingtower Aquatic Centre - $450,000 Direct to School.\n* Kew Primary School ?', 'A', '{"1":[[0.375,0.708333333]],"2":[[0.375,0.708333333]],"3":[[0.375,0.708333333]],"4":[[0.375,0.708333333]],"5":[[0.375,0.708333333]]}', '', '', '', '', '', '', ''),
(100, 'smartmove-computing-88874', 'Smartmove Computing', '', 'Locally owned and operated Sales, Service and repairs. PC and Apple, Part of the Leading Edge Group', 0, '2015-10-27 00:27:04', '2015-10-27 00:27:04', '', 0, 0, 'info@smartmoveechuca.com.au', '354801366', '', '', '', 0, 0, 0, 0, 'http://www.smartmoveechuca.com.au', 'Smartmove Computing is built on the assumption that the management of information technology for business and home users is like legal advice, accounting, graphic arts, and other bodies of knowledge, in that it is not inherently a do-it-yourself prospect. Smart business and home people who aren''t computer hobbyists need to find quality vendors of reliable hardware, software, service, and support. They need to use these quality vendors as they use their other professional service suppliers, as trusted allies.\n\nSmartmove Computing is such a vendor. It serves its clients as a trusted ally, providing them with the loyalty of a business partner and the economics of an outside vendor. We make sure that our clients have what they need to run their businesses as well as possible, with maximum efficiency and reliability. Many of our information applications are mission critical, so we give our clients the assurance that we will be there when they need us. We also maintain a friendly, fair, and creative work environment, which respects diversity, new ideas, and hard work. Being a member of the Leading Edge Group gives Smartmove Computing the buying power of the larger stores, with the reliability and effiency of a local store.', 'A', '{"1":[[0.375,0.7291666667]],"2":[[0.375,0.7291666667]],"3":[[0.375,0.7291666667]],"4":[[0.375,0.7291666667]],"5":[[0.375,0.7291666667]],"6":[[0.4166666667,0.5]]}', 'https://www.facebook.com/SmartmoveComputing', 'https://twitter.com/smartmoveechuca', '', '', '', '', '');
